INSERT INTO `recDetails` VALUES (191528,29967,1,'Henry IV Part II',0,NULL,NULL,'HenryIVPartII','2015-06-29 19:48:28');
INSERT INTO `recDetails` VALUES (191529,29967,3,'Henry IV, Part 2 is a history play by William Shakespeare, believed written between 1596 and 1599. It is the third part of a tetralogy, preceded by Richard II and Henry IV, Part 1 and succeeded by Henry V.\n\nThe play is often seen as an extension of aspects of Henry IV, Part 1, rather than a straightforward continuation of the historical narrative, placing more emphasis on the highly popular character of Falstaff and introducing other comic figures as part of his entourage, including Ancient Pistol, Doll Tearsheet and Justice Robert Shallow. Several scenes specifically parallel episodes in Part 1.',0,NULL,NULL,'HenryIVPart2isahistoryplaybyWil','2015-07-04 17:56:23');
INSERT INTO `recDetails` VALUES (191530,29967,9,'1597',0,NULL,NULL,'1597','2015-07-04 17:54:27');
INSERT INTO `recDetails` VALUES (191531,29973,1,'Much Ado About Nothing',0,NULL,NULL,'MuchAdoAboutNothing','2015-06-29 21:41:52');
INSERT INTO `recDetails` VALUES (191532,29973,3,'Much Ado About Nothing is a comedic play by William Shakespeare thought to have been written in 1598 and 1599, as Shakespeare was approaching the middle of his career. The play was included in the First Folio, published in 1623. Much Ado About Nothing is generally considered one of Shakespeare\'s best comedies, because it combines elements of robust hilarity with more serious meditations on honor, shame, and court politics. By means of \'noting\' (which, in Shakespeare\'s day, sounded the same as ‘nothing,\' and which is gossip, rumour, and overhearing), Benedick and Beatrice are tricked into confessing their love for each other, and Claudio is tricked into rejecting Hero at the altar on the erroneous belief that she has been unfaithful. At the end, Benedick and Beatrice join forces to set things right, and the others join in a dance celebrating the marriages of the two couples.',0,NULL,NULL,'MuchAdoAboutNothingisacomedicpl','2015-06-29 21:41:52');
INSERT INTO `recDetails` VALUES (191533,29973,9,'1598',0,NULL,NULL,'1598','2015-07-03 20:05:18');
INSERT INTO `recDetails` VALUES (191534,29974,1,'Henry V',0,NULL,NULL,'HenryV','2015-06-29 21:41:52');
INSERT INTO `recDetails` VALUES (191535,29974,3,'Henry V is a history play by William Shakespeare, believed to have been written in approximately 1599. It tells the story of King Henry V of England, focusing on events immediately before and after the Battle of Agincourt (1415) during the Hundred Years\' War. In the First Quarto text, it was entitled The Cronicle History of Henry the fift,:p.6 which became The Life of Henry the Fifth in the First Folio text. The play is the final part of a tetralogy, preceded by Richard II, Henry IV, Part 1 and Henry IV, Part 2. The original audiences would thus have already been familiar with the title character, who was depicted in the Henry IV plays as a wild, undisciplined lad known as \'Prince Harry\' and by Falstaff as \'Hal\'. In Henry V, the young prince has become a mature man and embarks on a successful conquest of France.',0,NULL,NULL,'HenryVisahistoryplaybyWilliamSh','2015-06-29 21:41:52');
INSERT INTO `recDetails` VALUES (191536,29974,9,'1598',0,NULL,NULL,'1598','2015-07-03 20:07:26');
INSERT INTO `recDetails` VALUES (191537,29975,1,'Julius Caesar',0,NULL,NULL,'JuliusCaesar','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191538,29975,3,'The Tragedy of Julius Caesar is a tragedy by William Shakespeare, believed to have been written in 1599. It is one of several plays written by Shakespeare based on true events from Roman history, which also include Coriolanus and Antony and Cleopatra. Although the title is Julius Caesar, Julius Caesar is not the most visible character in its action; he appears in only five scenes. Marcus Brutus speaks more than four times as many lines and the central psychological drama is his struggle between the conflicting demands of honour, patriotism and friendship.',0,NULL,NULL,'TheTragedyofJuliusCaesarisatrag','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191539,29975,9,'1599',0,NULL,NULL,'1599','2015-07-03 20:09:56');
INSERT INTO `recDetails` VALUES (191540,29976,1,'As You Like It',0,NULL,NULL,'AsYouLikeIt','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191541,29976,3,'As You Like It is a pastoral comedy by William Shakespeare believed to have been written in 1599 or early 1600 and first published in the First Folio, 1623. The play\'s first performance is uncertain, though a performance at Wilton House in 1603 has been suggested as a possibility. As You Like It follows its heroine Rosalind as she flees persecution in her uncle\'s court, accompanied by her cousin Celia to find safety and, eventually, love, in the Forest of Ardennes. In the forest, they encounter a variety of memorable characters, notably the melancholy traveller Jaques who speaks many of Shakespeare\'s most famous speeches (such as \'All the world\'s a stage\' and \'A fool! A fool! I met a fool in the forest\'). Jaques provides a sharp contrast to the other characters in the play, always observing and disputing the hardships of life in the country. Historically, critical response has varied, with some critics finding the work of lesser quality than other Shakespearean works and some finding the play a work of great merit. The play features one of Shakespeare\'s most famous and oft-quoted speeches, \'All the world\'s a stage\', and is the origin of the phrase \'too much of a good thing\'. The play remains a favourite among audiences and has been adapted for radio, film, and musical theatre. The piece has been a favorite for famous actors on stage and screen, notably Vanessa Redgrave, Juliet Stevenson, Rebecca Hall, Helen Mirren, and Patti LuPone in the role of Rosalind and Alan Rickman, Stephen Spinella, Kevin Kline and Stephen Dillane in the role of Jaques.',0,NULL,NULL,'AsYouLikeItisapastoralcomedybyW','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191542,29976,9,'1599',0,NULL,NULL,'1599','2015-07-03 20:12:17');
INSERT INTO `recDetails` VALUES (191543,29977,1,'Twelfth Night',0,NULL,NULL,'TwelfthNight','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191544,29977,3,'Twelfth Night, or What You Will is a comedy by William Shakespeare, believed to have been written around 1601–02 as a Twelfth Night\'s entertainment for the close of the Christmas season. The play centres on the twins Viola and Sebastian, who are separated in a shipwreck. Viola (who is disguised as a boy) falls in love with Duke Orsino, who in turn is in love with the Countess Olivia. Upon meeting Viola, Countess Olivia falls in love with her thinking she is a man. The play expanded on the musical interludes and riotous disorder expected of the occasion, with plot elements drawn from the short story \'Of Apollonius and Silla\' by Barnabe Rich, based on a story by Matteo Bandello. The first recorded performance was on 2 February 1602, at Candlemas, the formal end of Christmastide in the year\'s calendar. The play was not published until its inclusion in the 1623 First Folio.',0,NULL,NULL,'TwelfthNightorWhatYouWillisacom','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191545,29977,9,'1600',0,NULL,NULL,'1600','2015-07-03 20:17:42');
INSERT INTO `recDetails` VALUES (191546,29978,1,'Hamlet',0,NULL,NULL,'Hamlet','2015-06-29 21:41:53');
INSERT INTO `recDetails` VALUES (191547,29978,3,'The Tragedy of Hamlet, Prince of Denmark, often shortened to Hamlet (/ˈhæmlɨt/), is a tragedy written by William Shakespeare at an uncertain date between 1599 and 1602. Set in the Kingdom of Denmark, the play dramatises the revenge Prince Hamlet is instructed to enact on his uncle Claudius. Claudius had murdered his own brother, Hamlet\'s father King Hamlet, and subsequently seized the throne, marrying his deceased brother\'s widow, Hamlet\'s mother Gertrude. \n\nHamlet is Shakespeare\'s longest play and among the most powerful and influential tragedies in English literature, with a story capable of \'seemingly endless retelling and adaptation by others.\' The play seems to have been one of Shakespeare\'s most popular works during his lifetime and still ranks among his most-performed, topping the performance list of the Royal Shakespeare Company and its predecessors in Stratford-upon-Avon since 1879. It has inspired writers from Goethe and Dickens to Joyce and Murdoch, and has been described as \'the world\'s most filmed story after Cinderella\'. The story of Hamlet ultimately derives from the legend of Amleth, preserved by 13th-century chronicler Saxo Grammaticus in his Gesta Danorum, as subsequently retold by 16th-century scholar François de Belleforest. Shakespeare may also have drawn on an earlier (hypothetical) Elizabethan play known today as the Ur-Hamlet, though some scholars believe he himself wrote the Ur-Hamlet, later revising it to create the version of Hamlet we now have. He almost certainly created the title role for Richard Burbage, the leading tragedian of Shakespeare\'s time. In the 400 years since, the role has been performed by highly acclaimed actors from each successive age. \n\nThree different early versions of the play are extant, the First Quarto (Q1, 1603), the Second Quarto (Q2, 1604), and the First Folio (F1, 1623). Each version includes lines, and even entire scenes, missing from the others. ',0,NULL,NULL,'TheTragedyofHamletPrinceofDenma','2015-07-15 22:00:15');
INSERT INTO `recDetails` VALUES (191548,29978,9,'|VER=1|TYP=s|DAT=1600|COM=1600-1601|DET=0|CLD=Gregorian',0,NULL,NULL,'VER1TYPsDAT1600COM16001601DET0C','2015-07-15 21:52:19');
INSERT INTO `recDetails` VALUES (191549,29979,1,'The Merry Wives of Windsor',0,NULL,NULL,'TheMerryWivesofWindsor','2015-06-29 21:41:54');
INSERT INTO `recDetails` VALUES (191550,29979,3,'The Merry Wives of Windsor is a comedy by William Shakespeare, first published in 1602, though believed to have been written prior to 1597. The Windsor of the play\'s title is a reference to Windsor Castle in Berkshire, England, and though nominally set in the reign of Henry IV, the play makes no pretence to exist outside contemporary Elizabethan era English middle class life. It features the character Sir John Falstaff, the fat knight who had previously been featured in Henry IV Parts 1 and 2. It has been adapted for the opera on several occasions.',0,NULL,NULL,'TheMerryWivesofWindsorisacomedy','2015-06-29 21:41:54');
INSERT INTO `recDetails` VALUES (191551,29979,9,'1600',0,NULL,NULL,'1600','2015-07-04 18:00:52');
INSERT INTO `recDetails` VALUES (191552,29980,1,'Troilus and Cressida',0,NULL,NULL,'TroilusandCressida','2015-06-29 21:41:54');
INSERT INTO `recDetails` VALUES (191553,29980,3,'Troilus and Cressida is a tragedy by William Shakespeare, believed to have been written in 1602. It was described by Frederick S. Boas as one of Shakespeare\'s problem plays. The play ends on a very bleak note with the death of the noble Trojan Hector and destruction of the love between Troilus and Cressida. Throughout the play, the tone lurches wildly between bawdy comedy and tragic gloom, and readers and theatre-goers have frequently found it difficult to understand how one is meant to respond to the characters. However, several characteristic elements of the play (the most notable being its constant questioning of intrinsic values such as hierarchy, honour and love) have often been viewed as distinctly \'modern,\' as in the following remarks on the play by author and literary scholar Joyce Carol Oates: Troilus and Cressida, that most vexing and ambiguous of Shakespeare\'s plays, strikes the modern reader as a contemporary document—its investigation of numerous infidelities, its criticism of tragic pretensions, above all, its implicit debate between what is essential in human life and what is only existential are themes of the twentieth century. ... This is tragedy of a special sort—the \'tragedy\' the basis of which is the impossibility of conventional tragedy.',0,NULL,NULL,'TroilusandCressidaisatragedybyW','2015-06-29 21:41:54');
INSERT INTO `recDetails` VALUES (191554,29980,9,'1602',0,NULL,NULL,'1602','2015-07-03 20:22:36');
INSERT INTO `recDetails` VALUES (191558,29982,1,'Measure for Measure',0,NULL,NULL,'MeasureforMeasure','2015-06-29 21:41:54');
INSERT INTO `recDetails` VALUES (191559,29982,3,'Measure for Measure is a play by William Shakespeare, believed to have been written in 1603 or 1604. Originally published in the First Folio of 1623, where it was listed as a comedy, the play\'s first recorded performance occurred in 1604. The play\'s main themes include justice, \'mortality and mercy in Vienna,\' and the dichotomy between corruption and purity: \'some rise by sin, and some by virtue fall.\' Mercy and virtue predominate, since the play does not end tragically. Measure for Measure is often called one of Shakespeare\'s problem plays. It was, and continues to be, classified as comedy, though its tone and setting defy those expectations.',0,NULL,NULL,'MeasureforMeasureisaplaybyWilli','2015-06-29 21:41:54');
INSERT INTO `recDetails` VALUES (191560,29982,9,'1604',0,NULL,NULL,'1604','2015-07-04 18:24:49');
INSERT INTO `recDetails` VALUES (191561,29983,1,'Othello',0,NULL,NULL,'Othello','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191562,29983,3,'Othello (The Tragedy of Othello, the Moor of Venice) is a tragedy by William Shakespeare, believed to have been written in the year approximately 1603, and based on the short story Un Capitano Moro (\'A Moorish Captain\') by Cinthio, a disciple of Boccaccio, first published in 1565. This tightly constructed work revolves around four central characters: Othello, a Moorish general in the Venetian army; his beloved wife, Desdemona; his loyal lieutenant, Cassio; and his trusted but unfaithful ensign, Iago. Because of its varied and current themes of racism, love, jealousy, betrayal, revenge and repentance, Othello is still often performed in professional and community theatre alike and has been the basis for numerous operatic, film, and literary adaptations.',0,NULL,NULL,'OthelloTheTragedyofOthellotheMo','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191563,29983,9,'1604',0,NULL,NULL,'1604','2015-07-04 18:19:39');
INSERT INTO `recDetails` VALUES (191564,29984,1,'King Lear',0,NULL,NULL,'KingLear','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191565,29984,3,'King Lear is a tragedy by William Shakespeare in which the titular character descends into madness after disposing of his estate between two of his three daughters based on their flattery, bringing tragic consequences for all. Based on the legend of Leir of Britain, a mythological pre-Roman Celtic king, the play has been widely adapted for the stage and motion pictures, with the title role coveted by many of the world\'s most accomplished actors. Originally drafted between 1603 and its first known performance on St. Stephen\'s Day in 1606, the first attribution to Shakespeare was a 1608 publication in a quarto of uncertain provenance; it may be an early draft or simply reflect the first performance text. The Tragedy of King Lear, a more theatrical revision, was included in the 1623 First Folio. Modern editors usually conflate the two, though some insist that each version has its individual integrity that should be preserved. After the Restoration, the play was often revised with a happy ending for audiences who disliked its dark and depressing tone, but since the 19th century Shakespeare\'s original version has been regarded as one of his supreme achievements. The tragedy is particularly noted for its probing observations on the nature of human suffering and kinship. George Bernard Shaw wrote, \'No man will ever write a better tragedy than Lear\'.',0,NULL,NULL,'KingLearisatragedybyWilliamShak','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191566,29984,9,'1605',0,NULL,NULL,'1605','2015-07-03 20:03:24');
INSERT INTO `recDetails` VALUES (191567,29985,1,'Macbeth',0,NULL,NULL,'Macbeth','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191568,29985,3,'Macbeth (full title The Tragedy of Macbeth) is a tragedy written by William Shakespeare, and is considered one of his darkest and most powerful works. Set in Scotland, the play illustrates the damaging physical and psychological effects of political ambition on those who seek power for its own sake. The play is believed to have been written between 1599 and 1606, and is most commonly dated 1606. The earliest account of a performance of what was probably Shakespeare\'s play is the Summer of 1606, when Simon Forman recorded seeing such a play at the Globe Theatre. It was first published in the Folio of 1623, possibly from a prompt book. It was most likely written during the reign of James I, who had been James VI of Scotland before he succeeded to the English throne in 1603. James was a patron of Shakespeare\'s acting company, and of all the plays Shakespeare wrote during James\'s reign, Macbeth most clearly reflects the playwright\'s relationship with the sovereign. Macbeth is Shakespeare\'s shortest tragedy, and tells the story of a brave Scottish general named Macbeth who receives a prophecy from a trio of witches that one day he will become King of Scotland. Consumed by ambition and spurred to action by his wife, Macbeth murders King Duncan and takes the throne for himself. He is then wracked with guilt and paranoia, and he soon becomes a tyrannical ruler as he is forced to commit more and more murders to protect himself from enmity and suspicion. The bloodbath and consequent civil war swiftly take Macbeth and Lady Macbeth into the realms of arrogance, madness, and death. Shakespeare\'s source for the tragedy is the account of Macbeth, King of Scotland, Macduff, and Duncan in Holinshed\'s Chronicles (1587), a history of England, Scotland, and Ireland familiar to Shakespeare and his contemporaries, although the events in the play differ extensively from the history of the real Macbeth. In recent scholarship, the events of the tragedy are usually associated more closely with the execution of Henry Garnett for complicity in the Gunpowder Plot of 1605. In the backstage world of theatre, some believe that the play is cursed, and will not mention its title aloud, referring to it instead as \'the Scottish play\'. Over the course of many centuries, the play has attracted some of the most renowned actors to the roles of Macbeth and Lady Macbeth. It has been adapted to film, television, opera, novels, comic books, and other media.',0,NULL,NULL,'MacbethfulltitleTheTragedyofMac','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191569,29985,9,'1605',0,NULL,NULL,'1605','2015-07-04 18:10:39');
INSERT INTO `recDetails` VALUES (191570,29986,1,'Antony and Cleopatra',0,NULL,NULL,'AntonyandCleopatra','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191571,29986,3,'Antony and Cleopatra is a tragedy by William Shakespeare. The play was probably performed first in about 1607 at Blackfriars Theatre or the Globe Theatre by the King\'s Men. Its first known appearance in print was in the First Folio of 1623. The plot is based on Thomas North\'s translation of Plutarch\'s Lives and follows the relationship between Cleopatra and Mark Antony from the time of the Sicilian revolt to Cleopatra\'s suicide during the Final War of the Roman Republic. The major antagonist is Octavius Caesar, one of Antony\'s fellow triumviri of the Second Triumvirate and the first emperor of the Roman Empire, Augustus Caesar. The tragedy is set in Rome and Egypt, characterised by swift, panoramic shifts in geographical locations and in registers, alternating between sensual, imaginative Alexandria and the more pragmatic, austere Rome. Many consider Cleopatra one of the most complex female characters in Shakespeare\'s body of work.:p.45 She is frequently vain and histrionic, almost provoking an audience to scorn; at the same time, Shakespeare\'s efforts invest both her and Antony with tragic grandeur. These contradictory features have led to famously divided critical responses. It is difficult to classify Antony and Cleopatra as belonging to a single genre. It can be described as a history play (though it does not completely adhere to historical account), tragedy (though not completely in Aristotelian terms), comedy, and a romance.',0,NULL,NULL,'AntonyandCleopatraisatragedybyW','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191572,29986,9,'1606',0,NULL,NULL,'1606','2015-07-04 18:03:07');
INSERT INTO `recDetails` VALUES (191573,29987,1,'Coriolanus',0,NULL,NULL,'Coriolanus','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191574,29987,3,'Coriolanus (/kɒriəˈleɪnəs/ or /kɒriəˈlaːnəs/) is a tragedy by William Shakespeare, believed to have been written between 1605 and 1608. The play is based on the life of the legendary Roman leader Caius Marcius Coriolanus. The tragedy is numbered as one of the last two tragedies written by Shakespeare along with Antony and Cleopatra. Coriolanus is the name given to a Roman general after his more than adequate military success against various uprisings challenging the government of Rome. Following this success, Coriolanus becomes active in politics and seeks political leadership. His temperament is unsuited for popular leadership and he is quickly deposed, whereupon he aligns himself to set matters straight according to his own will. The alliances he forges to accomplish his own will result in his ultimate downfall and death. Coriolanus is often staged in full theatre productions and has recently been featured as a full-length film under the same title with the leading role played by Ralph Fiennes.',0,NULL,NULL,'Coriolanuskɒriəˈleɪnəsorkɒriəˈl','2015-06-29 21:41:55');
INSERT INTO `recDetails` VALUES (191575,29987,9,'1607',0,NULL,NULL,'1607','2015-07-04 18:08:25');
INSERT INTO `recDetails` VALUES (191576,29988,1,'Timon of Athens',0,NULL,NULL,'TimonofAthens','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191577,29988,3,'Timon of Athens (The Life of Tymon of Athens) is a play by William Shakespeare, published in the First Folio (1623) and probably written in collaboration with another author, most likely Thomas Middleton, in about 1605–1606. It is about the fortunes of an Athenian named Timon (and probably influenced by the philosopher of the same name). The central character is a well beloved citizen of Athens who through tremendous generosity spends his entire fortunes on corrupt hangers-on only interested in getting the next payout. The earliest known production of the play was in 1674, when Thomas Shadwell wrote an adaptation under the title The History of Timon of Athens, The Man-hater. Multiple other adaptations followed over the next century, by writers such as Thomas Hull, James Love and Richard Cumberland. The straight Shakespearean text was at Smock Alley in Dublin in 1761, but adaptations continued to dominate the stage until well into the 20th century. Timon of Athens was originally grouped with the tragedies, but some scholars name it one of the problem plays.',0,NULL,NULL,'TimonofAthensTheLifeofTymonofAt','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191578,29988,9,'1607',0,NULL,NULL,'1607','2015-07-04 18:17:38');
INSERT INTO `recDetails` VALUES (191579,29989,1,'Pericles',0,NULL,NULL,'Pericles','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191580,29989,3,'Pericles, Prince of Tyre is a Jacobean play written at least in part by William Shakespeare and included in modern editions of his collected works despite questions over its authorship, as it was not included in the First Folio. Whilst various arguments support that Shakespeare is the sole author of the play (notably DelVecchio and Hammond\'s Cambridge edition of the play), modern editors generally agree that Shakespeare is responsible for almost exactly half the play—827 lines—the main portion after scene 9 that follows the story of Pericles and Marina.[a] Modern textual studies indicate that the first two acts of 835 lines detailing the many voyages of Pericles were written by a mediocre collaborator, which strong evidence suggests to have been the victualler, panderer, dramatist and pamphleteer George Wilkins.:p.291–332',0,NULL,NULL,'PericlesPrinceofTyreisaJacobean','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191581,29989,9,'1608',0,NULL,NULL,'1608','2015-07-04 18:22:06');
INSERT INTO `recDetails` VALUES (191582,29990,1,'Cymbeline',0,NULL,NULL,'Cymbeline','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191583,29990,3,'Cymbeline /ˈsɪmbɨliːn/, also known as Cymbeline, King of Britain or The Tragedy of Cymbeline, is a play by William Shakespeare, set in Ancient Britain and based on legends that formed part of the Matter of Britain concerning the early Celtic British King Cunobeline. Although listed as a tragedy in the First Folio, modern critics often classify Cymbeline as a romance. Like Othello and The Winter\'s Tale, it deals with the themes of innocence and jealousy. While the precise date of composition remains unknown, the play was certainly produced as early as 1611.',0,NULL,NULL,'CymbelineˈsɪmbɨliːnalsoknownasC','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191584,29990,9,'1609',0,NULL,NULL,'1609','2015-07-04 18:04:34');
INSERT INTO `recDetails` VALUES (191585,29991,1,'The Winter’s Tale',0,NULL,NULL,'TheWinter’sTale','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191586,29991,3,'The Winter\'s Tale is a play by William Shakespeare, originally published in the First Folio of 1623. Although it was grouped among the comedies, some modern editors have relabelled the play as one of Shakespeare\'s late romances. Some critics consider it to be one of Shakespeare\'s \'problem plays’, because the first three acts are filled with intense psychological drama, while the last two acts are comedic and supply a happy ending. The play has been intermittently popular, revived in productions in various forms and adaptations by some of the leading theatre practitioners in Shakespearean performance history, beginning after a long interval with David Garrick in his adaptation Florizel and Perdita (first performed in 1754 and published in 1756). The Winter\'s Tale was revived again in the 19th century, when the fourth \'pastoral\' act was widely popular. In the second half of the 20th century The Winter\'s Tale in its entirety, and drawn largely from the First Folio text, was often performed, with varying degrees of success.',0,NULL,NULL,'TheWintersTaleisaplaybyWilliamS','2015-06-29 21:41:56');
INSERT INTO `recDetails` VALUES (191587,29991,9,'1610',0,NULL,NULL,'1610','2015-07-04 18:13:17');
INSERT INTO `recDetails` VALUES (191588,29992,1,'The Tempest',0,NULL,NULL,'TheTempest','2015-06-29 21:41:57');
INSERT INTO `recDetails` VALUES (191589,29992,3,'The Tempest is a play by William Shakespeare, believed to have been written in 1610–11, and thought by many critics to be the last play that Shakespeare wrote alone. It is set on a remote island, where Prospero, the rightful Duke of Milan, plots to restore his daughter Miranda to her rightful place using illusion and skilful manipulation. He conjures up a storm, the eponymous tempest, to lure his usurping brother Antonio and the complicit King Alonso of Naples to the island. There, his machinations bring about the revelation of Antonio\'s lowly nature, the redemption of the King, and the marriage of Miranda to Alonso\'s son, Ferdinand. There is no obvious single source for the plot of The Tempest, but researchers have seen parallels in Erasmus\'s Naufragium, Peter Martyr\'s De orbe novo, and eyewitness reports by William Strachey and Sylvester Jordain of the real-life shipwreck of the Sea Venture on the islands of Bermuda, and the subsequent conflict between Sir Thomas Gates and Sir George Somers. In addition, one of Gonzalo\'s speeches is derived from Montaigne\'s essay Of the Canibales, and much of Prospero\'s renunciative speech is taken word for word from a speech by Medea in Ovid\'s poem Metamorphoses. The masque in Act 4 may have been a later addition, possibly in honour of the wedding of Princess Elizabeth and Frederick V in 1613. The play was first published in the First Folio of 1623. The story draws heavily on the tradition of the romance, and it was influenced by tragicomedy and the courtly masque and perhaps by the commedia dell\'arte. It differs from Shakespeare\'s other plays in its observation of a stricter, more organised neoclassical style. Critics see The Tempest as explicitly concerned with its own nature as a play, frequently drawing links between Prospero\'s \'art\' and theatrical illusion, and early critics saw Prospero as a representation of Shakespeare, and his renunciation of magic as signalling Shakespeare\'s farewell to the stage. The play portrays Prospero as a rational, and not an occultist, magician by providing a contrast to him in Sycorax: her magic is frequently described as destructive and terrible, where Prospero\'s is said to be wondrous and beautiful. Beginning in about 1950, with the publication of Psychology of Colonization by Octave Mannoni, The Tempest was viewed more and more through the lens of postcolonial theory—exemplified in adaptations like Aimé Césaire\'s Une Tempête set in Haiti—and there is even a scholarly journal on post-colonial criticism named after Caliban. The Tempest did not attract a significant amount of attention before the closing of the theatres in 1642, and only attained popularity after the Restoration, and then only in adapted versions. In the mid-19th century, theatre productions began to reinstate the original Shakespearean text, and in the 20th century, critics and scholars undertook a significant re-appraisal of the play\'s value, to the extent that it is now considered to be one of Shakespeare\'s greatest works. It has been adapted numerous times in a variety of styles and formats: in music, at least 46 operas by composers such as Fromental Halévy, Zdeněk Fibich and Thomas Adès; orchestral works by Tchaikovsky, Arthur Sullivan and Arthur Honegger; and songs by such diverse artists as Ralph Vaughan Williams, Michael Nyman and Pete Seeger; in literature, Percy Bysshe Shelley\'s poem With a Guitar, To Jane and W. H. Auden\'s The Sea and the Mirror; novels by Aimé Césaire and The Diviners by Margaret Laurence; in paintings by William Hogarth, Henry Fuseli, and John Everett Millais; and on screen, ranging through a hand-tinted version of Herbert Beerbohm Tree\'s 1905 stage performance, the science fiction film Forbidden Planet in 1956, Peter Greenaway\'s 1991 Prospero\'s Books featuring John Gielgud as Prospero, to Julie Taymor\'s 2010 film version which changed Prospero to Prospera (as played by Helen Mirren), and Des McAnuff\'s 2010 Stratford Shakespeare Festival production which starred Christopher Plummer.',0,NULL,NULL,'TheTempestisaplaybyWilliamShake','2015-06-29 21:41:57');
INSERT INTO `recDetails` VALUES (191590,29992,9,'1611',0,NULL,NULL,'1611','2015-07-04 18:11:54');
INSERT INTO `recDetails` VALUES (191591,29993,1,'Henry VIII',0,NULL,NULL,'HenryVIII','2015-06-29 21:41:57');
INSERT INTO `recDetails` VALUES (191592,29993,3,'Henry VIII is a collaborative history play, written by William Shakespeare and John Fletcher, based on the life of Henry VIII of England. An alternative title, All is True, is recorded in contemporary documents, the title Henry VIII not appearing until the play\'s publication in the First Folio of 1623. Stylistic evidence indicates that individual scenes were written by either Shakespeare or his collaborator and successor, John Fletcher. It is also somewhat characteristic of the late romances in its structure. It is noted for having more stage directions than any of Shakespeare\'s other plays. During a performance of Henry VIII at the Globe Theatre in 1613, a cannon shot employed for special effects ignited the theatre\'s thatched roof (and the beams), burning the original building to the ground.',0,NULL,NULL,'HenryVIIIisacollaborativehistor','2015-06-29 21:41:57');
INSERT INTO `recDetails` VALUES (191593,29993,9,'1612',0,NULL,NULL,'1612','2015-07-04 18:23:38');
INSERT INTO `recDetails` VALUES (191594,29994,1,'The Two Noble Kinsmen',0,NULL,NULL,'TheTwoNobleKinsmen','2015-06-29 21:41:58');
INSERT INTO `recDetails` VALUES (191595,29994,3,'The Two Noble Kinsmen is essentially an adaptation of Chaucer\'s Knight\'s Tale. In this story, the two kinsmen are Palamon and Arcite; they are captured while fighting for Thebes against Athens. While imprisoned, the two cousins find themselves attracted to Emilia, who is the sister of Hippolyta, wife of Theseus. Their professed \"eternal friendship\" takes a beating as the two vow to woo her. Theseus exiles Arcite from Athens and leaves Palamon in jail.',0,NULL,NULL,'TheTwoNobleKinsmenisessentially','2015-11-09 11:01:24');
INSERT INTO `recDetails` VALUES (191596,29994,9,'1612',0,NULL,NULL,'1612','2015-07-04 18:16:12');
INSERT INTO `recDetails` VALUES (191597,29995,1,'Two Gentleman of Verona',0,NULL,NULL,'TwoGentlemanofVerona','2015-07-03 01:41:43');
INSERT INTO `recDetails` VALUES (191598,29995,3,'A comedy by William Shakespeare, believed to have been written between 1589 and 1592. It is considered by some to be Shakespeare\'s first play,[a] and is often seen as showing his first tentative steps in laying out some of the themes and motifs with which he would later deal in more detail; for example, it is the first of his plays in which a heroine dresses as a boy. The play deals with the themes of friendship and infidelity, the conflict between friendship and love, and the foolish behaviour of people in love. The highlight of the play is considered by some to be Launce, the clownish servant of Proteus, and his dog Crab, to whom \'the most scene-stealing non-speaking role in the canon\' has been attributed. Two Gentlemen is often regarded as one of Shakespeare\'s weakest plays. It has the smallest named cast of any play by Shakespeare.',0,NULL,NULL,'AcomedybyWilliamShakespearebeli','2015-07-03 01:41:43');
INSERT INTO `recDetails` VALUES (191599,29995,9,'1589',0,NULL,NULL,'1589','2015-07-03 01:39:20');
INSERT INTO `recDetails` VALUES (191600,29996,1,'Romeo and Juliet',0,NULL,NULL,'RomeoandJuliet','2015-06-29 21:41:58');
INSERT INTO `recDetails` VALUES (191601,29996,3,'is a tragedy written by William Shakespeare early in his career about two young star-crossed lovers whose deaths ultimately reconcile their feuding families. It was among Shakespeare\'s most popular plays during his lifetime and, along with Hamlet, is one of his most frequently performed plays. Today, the title characters are regarded as archetypal young lovers. Romeo and Juliet belongs to a tradition of tragic romances stretching back to antiquity. Its plot is based on an Italian tale, translated into verse as The Tragical History of Romeus and Juliet by Arthur Brooke in 1562 and retold in prose in Palace of Pleasure by William Painter in 1567. Shakespeare borrowed heavily from both but, to expand the plot, developed supporting characters, particularly Mercutio and Paris. Believed to have been written between 1591 and 1595, the play was first published in a quarto version in 1597. This text was of poor quality, and later editions corrected it, bringing it more in line with Shakespeare\'s original. Shakespeare\'s use of his poetic dramatic structure, especially effects such as switching between comedy and tragedy to heighten tension, his expansion of minor characters, and his use of sub-plots to embellish the story, has been praised as an early sign of his dramatic skill. The play ascribes different poetic forms to different characters, sometimes changing the form as the character develops. Romeo, for example, grows more adept at the sonnet over the course of the play. Romeo and Juliet has been adapted numerous times for stage, film, musical and opera. During the English Restoration, it was revived and heavily revised by William Davenant. David Garrick\'s 18th-century version also modified several scenes, removing material then considered indecent, and Georg Benda\'s operatic adaptation omitted much of the action and added a happy ending. Performances in the 19th century, including Charlotte Cushman\'s, restored the original text, and focused on greater realism. John Gielgud\'s 1935 version kept very close to Shakespeare\'s text, and used Elizabethan costumes and staging to enhance the drama. In the 20th and into the 21st century, the play has been adapted in versions as diverse as George Cukor\'s comparatively faithful 1936 production, Franco Zeffirelli\'s 1968 version, Baz Luhrmann\'s 1996 MTV-inspired Romeo + Juliet and the 2013 non-Shakespearian adaptation by Carlo Carlei.',0,NULL,NULL,'isatragedywrittenbyWilliamShake','2015-06-29 21:41:58');
INSERT INTO `recDetails` VALUES (191602,29996,9,'1591',0,NULL,NULL,'1591','2015-07-04 17:49:28');
INSERT INTO `recDetails` VALUES (191603,29997,1,'A Midsummer Night\'s Dream',0,NULL,NULL,'AMidsummerNightsDream','2015-06-29 21:41:58');
INSERT INTO `recDetails` VALUES (191604,29997,3,'A comedy play by William Shakespeare, believed to have been written between 1590 and 1597. It portrays the events surrounding the marriage of the Duke of Athens, Theseus, and Hippolyta. These include the adventures of four young Athenian lovers and a group of six amateur actors (mechanicals), who are controlled and manipulated by the fairies who inhabit the forest in which most of the play is set. The play is one of Shakespeare\'s most popular works for the stage and is widely performed across the world.',0,NULL,NULL,'AcomedyplaybyWilliamShakespeare','2015-07-15 21:17:56');
INSERT INTO `recDetails` VALUES (191605,29997,9,'1590',0,NULL,NULL,'1590','2015-07-01 22:05:22');
INSERT INTO `recDetails` VALUES (191606,29998,1,'The Merchant of Venice',0,NULL,NULL,'TheMerchantofVenice','2015-06-29 21:41:59');
INSERT INTO `recDetails` VALUES (191607,29998,3,'is a play by William Shakespeare in which a merchant in 16th century Venice must default on a large loan provided by an abused Jewish moneylender. It is believed to have been written between 1596 and 1598. Though classified as a comedy in the First Folio and sharing certain aspects with Shakespeare\'s other romantic comedies, the play is perhaps most remembered for its dramatic scenes, and is best known for Shylock and the famous \'Hath not a Jew eyes?\' speech. Also notable is Portia\'s speech about \'the quality of mercy\'.',0,NULL,NULL,'isaplaybyWilliamShakespeareinwh','2015-06-29 21:41:59');
