INSERT INTO `recDetails` VALUES (191744,30048,1,'Taming of the Shrew',0,NULL,NULL,'TamingoftheShrew','2015-07-03 01:50:09');
INSERT INTO `recDetails` VALUES (191745,30048,15,'29964',0,NULL,NULL,'29964','2015-07-03 01:50:09');
INSERT INTO `recDetails` VALUES (191746,30048,3,'The Taming of the Shrew is a comedy by William Shakespeare, believed to have been written between 1590 and 1592.\n\nThe play begins with a framing device, often referred to as the induction,[a] in which a mischievous nobleman tricks a drunken tinker named Christopher Sly into believing he is actually a nobleman himself. The nobleman then has the play performed for Sly\'s diversion.\n\nThe main plot depicts the courtship of Petruchio and Katherina, the headstrong, obdurate shrew. Initially, Katherina is an unwilling participant in the relationship, but Petruchio tempers her with various psychological torments—the \"taming\"—until she becomes a compliant and obedient bride. The subplot features a competition between the suitors of Katherina\'s more desirable sister, Bianca. The play\'s apparent misogynistic elements have become the subject of considerable controversy, particularly among modern scholars, audiences and readers.\n\nTaming has been adapted numerous times for stage, screen, opera, ballet, and musical theatre; perhaps the most famous adaptations being Cole Porter\'s Kiss Me, Kate and the 1967 film of the play, starring Elizabeth Taylor and Richard Burton. The 1999 high school comedy film 10 Things I Hate About You is also loosely based on the play.',0,NULL,NULL,'TheTamingoftheShrewisacomedybyW','2015-07-03 01:50:09');
INSERT INTO `recDetails` VALUES (191747,30048,9,'1590',0,NULL,NULL,'1590','2015-07-03 01:50:09');
