INSERT INTO `recDetails` VALUES (191749,30049,1,'Tititus Andronicus',0,NULL,NULL,'TititusAndronicus','2015-07-03 01:53:00');
INSERT INTO `recDetails` VALUES (191750,30049,15,'29964',0,NULL,NULL,'29964','2015-07-03 01:53:00');
INSERT INTO `recDetails` VALUES (191751,30049,3,'Tititus Andronicus is a tragedy by William Shakespeare, believed to have been written between 1588 and 1593, probably in collaboration with George Peele. It is thought to be Shakespeare\'s first tragedy, and is often seen as his attempt to emulate the violent and bloody revenge plays of his contemporaries, which were extremely popular with audiences throughout the sixteenth century.[1]\n\nThe play is set during the latter days of the Roman Empire and tells the fictional story of Titus, a general in the Roman army, who is engaged in a cycle of revenge with Tamora, Queen of the Goths. It is Shakespeare\'s bloodiest and most violent work and traditionally was one of his least respected plays. Although it was extremely popular in its day, by the later seventeenth century it had fallen out of favour. In the Victorian era, it was disapproved of primarily because of what was considered to be a distasteful use of graphic violence, but from around the middle of the twentieth century its reputation began to improve.',0,NULL,NULL,'TititusAndronicusisatragedybyWi','2015-07-03 01:53:00');
INSERT INTO `recDetails` VALUES (191752,30049,9,'1588',0,NULL,NULL,'1588','2015-07-03 01:53:00');
