INSERT INTO `recDetails` VALUES (191855,30061,20,'414',0,NULL,NULL,'414','2015-07-04 18:46:40');
INSERT INTO `recDetails` VALUES (191856,30061,3,'William Jaggard (c. 1568 – November 1623) was an Elizabethan and Jacobean printer and publisher, best known for his connection with the texts of William Shakespeare, most notably the First Folio of Shakespeare\'s plays. Jaggard\'s shop was \"at the sign of the Half-Eagle and Key in Barbican.\"[1]',0,NULL,NULL,'WilliamJaggardc1568–November162','2015-07-04 18:46:40');
INSERT INTO `recDetails` VALUES (191857,30062,15,'30061',0,NULL,NULL,'30061','2015-07-04 18:47:53');
INSERT INTO `recDetails` VALUES (191858,30062,27,'London',0,NULL,NULL,'London','2015-07-04 18:47:53');
INSERT INTO `recDetails` VALUES (191859,30062,3,'n 1608 Jaggard bought out the business of the elderly James Roberts, a printer with significant connections to the Shakespeare canon. Roberts printed the second quarto of Titus Andronicus for bookseller Edward White and the first quarto of Merchant of Venice for Thomas Heyes (both 1600); he printed the second quarto of Hamlet for Nicholas Ling in 1604.[6] Roberts also owned the concession to print the handbills that the actors\' companies used to advertise their productions. Jaggard sought the same monopoly; he did not obtain it, however, until 1615.\n\nJaggard had a twenty-year involvement with works of the Shakespeare canon, starting with his publication of the questionable collection The Passionate Pilgrim under Shakespeare\'s name in 1599. Jaggard printed an expanded edition of the same work in 1612. In 1619 Jaggard was at the center of the cryptic False Folio affair; and in the period 1621–23 his print shop was occupied on the massive task of bringing the First Folio into print.\n\nGiven his apparently less-than-respectable links with The Passionate Pilgrim and the False Folio, commentators have wondered why John Heminges and Henry Condell, the two members of the King\'s Men who compiled the texts of the First Folio, chose Jaggard for the First Folio job. Some scholars have argued that it may have been a matter of necessity; Jaggard\'s shop had the capacity for a project of such a scale.',0,NULL,NULL,'n1608Jaggardboughtoutthebusines','2015-07-04 18:47:53');
