INSERT INTO `recDetails` VALUES (191878,30070,3,'In the stage directions he is referred to as \"Ghost.\" His name is also Hamlet, and he is referred to as King Hamlet to distinguish him from the Prince.\n\nHe is loosely based on a legendary Jutish chieftain, named Horwendill, who appears in Chronicon Lethrense and in Saxo Grammaticus\' Gesta Danorum. According to oral tradition, the Ghost was originally played by Shakespeare himself.',0,NULL,NULL,'Inthestagedirectionsheisreferre','2015-07-05 20:17:21');
