INSERT INTO `recDetails` VALUES (191889,30072,3,'King Claudius is a fictional character and the primary antagonist of William Shakespeare\'s tragedy Hamlet. He is the brother to King Hamlet, second husband to Gertrude and uncle to Hamlet. He obtained the throne of Denmark by murdering his own brother with poison and then marrying the late king\'s widow. He is loosely based on the Jutish chieftain Feng who appears in Chronicon Lethrense and in Saxo Grammaticus\' Gesta Danorum. There had never been an actual Danish King of that name.',0,NULL,NULL,'KingClaudiusisafictionalcharact','2015-07-05 20:09:05');
