INSERT INTO `recDetails` VALUES (191895,30074,3,'Gertrude is Hamlet\'s mother and Queen of Denmark. Her relationship with Hamlet is somewhat turbulent, since he resents her for marrying her husband\'s brother Claudius after he murdered the King (young Hamlet\'s father, King Hamlet). Gertrude reveals no guilt in her marriage with Claudius after the recent murder of her husband, and Hamlet begins to show signs of jealousy towards Claudius. According to Hamlet, she scarcely mourned her husband\'s death before marrying Claudius.',0,NULL,NULL,'GertrudeisHamletsmotherandQueen','2015-07-05 20:18:31');
