INSERT INTO `recDetails` VALUES (191915,30080,1,'Polonius',0,NULL,NULL,'Polonius','2015-07-06 21:02:04');
INSERT INTO `recDetails` VALUES (191916,30080,165,'Chief counselor to the king',0,NULL,NULL,'Chiefcounselortotheking','2015-07-06 21:02:04');
INSERT INTO `recDetails` VALUES (191917,30080,3,'Polonius is a character in William Shakespeare\'s Hamlet. He is chief counselor of the king, and the father of Laertes and Ophelia. Generally regarded as wrong in every judgment he makes over the course of the play,[1] Polonius is described by William Hazlitt as a \"sincere\" father, but also \"a busy-body, [who] is accordingly officious, garrulous, and impertinent.\"[2] In Act II Hamlet refers to Polonius as a \"tedious old fool\"[3] and taunts him as a latter day \"Jeptha\".[4]\n\nPolonius connives with Claudius to spy on Hamlet. Hamlet unknowingly kills Polonius, provoking Ophelia\'s fit of madness, ultimately resulting in her early death and the climax of the play: a duel between Laertes and Hamlet.',0,NULL,NULL,'PoloniusisacharacterinWilliamSh','2015-07-06 21:02:04');
INSERT INTO `recDetails` VALUES (191918,30081,1,'Ophelia',0,NULL,NULL,'Ophelia','2015-07-06 21:41:14');
INSERT INTO `recDetails` VALUES (191919,30081,3,'Ophelia is a fictional character in the play Hamlet by William Shakespeare. She is a young noblewoman of Denmark, the daughter of Polonius, sister of Laertes, and potential wife of Prince Hamlet. She is one of only two female characters in the play.”',0,NULL,NULL,'Opheliaisafictionalcharacterint','2015-07-06 21:41:14');
INSERT INTO `recDetails` VALUES (191920,30081,165,'Daughter to Polonius',0,NULL,NULL,'DaughtertoPolonius','2015-07-06 21:41:14');
INSERT INTO `recDetails` VALUES (191921,30082,1,'Horatio',0,NULL,NULL,'Horatio','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191922,30082,3,'Horatio is a character in William Shakespeare\'s tragedy Hamlet. Horatio\'s origins are unknown, although he was present on the battlefield when Hamlet\'s father defeated \'the ambitious Norway\'.,Fortinbras (The king), and attended Wittenberg university with prince Hamlet. Horatio is evidently not directly involved in the intrigue at the Danish court; thus, he makes a good foil or sounding board for Prince Hamlet. He is often not identified as any specific court position, but simply as \'friend to Hamlet.',0,NULL,NULL,'HoratioisacharacterinWilliamSha','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191923,30082,165,'Friend to Hamlet',0,NULL,NULL,'FriendtoHamlet','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191924,30083,1,'Laertes',0,NULL,NULL,'Laertes','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191925,30083,3,'Laertes /leɪˈɜrtiːz/ is a character in William Shakespeare\'s play Hamlet. His name is taken from the father of Odysseus in Homer\'s Odyssey. Laertes is the son of Polonius and the brother of Ophelia. In the final scene, he kills Hamlet with a poisoned sword to avenge the deaths of his father and sister, for which he blamed Hamlet. While dying of the same poison, he implicates King Claudius. The Laertes character is thought to be originally from Shakespeare, as there is no equivalent character in any of the known sources for the play. However, it is possible that he is loosely based on Wihtlæg of Germanic legend.',0,NULL,NULL,'Laertesleɪˈɜrtiːzisacharacterin','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191926,30083,165,'Son to Polonius',0,NULL,NULL,'SontoPolonius','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191927,30084,1,'Rosencrantz',0,NULL,NULL,'Rosencrantz','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191928,30084,3,'Rosencrantz and Guildenstern are characters in William Shakespeare\'s tragedy Hamlet. They are childhood friends of Hamlet, summoned by King Claudius to distract the prince from his apparent madness and if possible to ascertain the cause of it. The characters were revived in W. S. Gilbert\'s satire, Rosencrantz and Guildenstern, and as the alienated heroes of Tom Stoppard\'s absurdist play, Rosencrantz and Guildenstern Are Dead. Rosencrantz (\'rosary\') and Gyldenstjerne/Gyllenstierna (\'golden star\') were names of Danish (and Swedish) noble families of the 16th century; records of the Danish royal coronation of 1596 show that one tenth of the aristocrats participating bore one or the other name. James Voelkel suggests that the characters were named after Frederick Rosenkrantz and Knud Gyldenstierne (cousins of Tycho Brahe), who had visited England in 1592.',0,NULL,NULL,'RosencrantzandGuildensternarech','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191929,30084,165,'Courtier & friend to Hamlet',0,NULL,NULL,'CourtierfriendtoHamlet','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191930,30085,1,'Guildenstern',0,NULL,NULL,'Guildenstern','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191931,30085,3,'Rosencrantz and Guildenstern are characters in William Shakespeare\'s tragedy Hamlet. They are childhood friends of Hamlet, summoned by King Claudius to distract the prince from his apparent madness and if possible to ascertain the cause of it. The characters were revived in W. S. Gilbert\'s satire, Rosencrantz and Guildenstern, and as the alienated heroes of Tom Stoppard\'s absurdist play, Rosencrantz and Guildenstern Are Dead. Rosencrantz (\'rosary\') and Gyldenstjerne/Gyllenstierna (\'golden star\') were names of Danish (and Swedish) noble families of the 16th century; records of the Danish royal coronation of 1596 show that one tenth of the aristocrats participating bore one or the other name. James Voelkel suggests that the characters were named after Frederick Rosenkrantz and Knud Gyldenstierne (cousins of Tycho Brahe), who had visited England in 1592.',0,NULL,NULL,'RosencrantzandGuildensternarech','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191932,30085,165,'Courtier & friend to Hamlet',0,NULL,NULL,'CourtierfriendtoHamlet','2015-07-06 21:41:15');
INSERT INTO `recDetails` VALUES (191933,30086,1,'Fortinbras',0,NULL,NULL,'Fortinbras','2015-07-06 21:41:16');
INSERT INTO `recDetails` VALUES (191934,30086,3,'Fortinbras is the name of two minor fictional characters from William Shakespeare\'s tragedy Hamlet. The more notable is a Norwegian crown prince with a few brief scenes in the play, who delivers the final lines that represent a hopeful future for the monarchy of Denmark and its subjects. Fortinbras is also the name of the former king of Norway and father of the crown prince Fortinbras. King Fortinbras was slain in the play\'s antecedent action in battle with King Hamlet. The battle between the two is described by Horatio in act one, scene one (I,i) of the play.',0,NULL,NULL,'Fortinbrasisthenameoftwominorfi','2015-07-06 21:41:16');
INSERT INTO `recDetails` VALUES (191935,30086,165,'Prince of Norway',0,NULL,NULL,'PrinceofNorway','2015-07-06 21:41:16');
INSERT INTO `recDetails` VALUES (191936,30080,166,'30079',0,NULL,NULL,'30079','2015-07-06 21:42:40');
INSERT INTO `recDetails` VALUES (191937,30087,1,'Gravedigger',0,NULL,NULL,'Gravedigger','2015-07-06 21:48:04');
INSERT INTO `recDetails` VALUES (191938,30087,3,'The Gravediggers (or Clowns) are examples of Shakespearean fools (also known as clowns or jesters), a recurring type of character in Shakespeare\'s plays. Like most Shakespearean fools, the Gravediggers are peasants or commoners that use their great wit and intellect to get the better of their superiors, other people of higher social status, and each other. The Gravediggers appear briefly in Shakespeare\'s tragedy Hamlet, making their one and only appearance at the beginning of Act V, scene i. They are first encountered as they are digging a grave for the newly deceased Ophelia, discussing whether she deserves a Christian burial after having killed herself. Soon, Hamlet enters and engages in a quick dialogue with the first Gravedigger. The beat ends with Hamlet\'s speech regarding the circle of life prompted by his discovery of the skull of his father\'s beloved jester, Yorick.',0,NULL,NULL,'TheGravediggersorClownsareexamp','2015-07-06 21:48:04');
