INSERT INTO `recDetails` VALUES (192003,30117,1,'Prince Escalus',0,NULL,NULL,'PrinceEscalus','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192004,30117,3,'Prince Escalus, the Prince of Verona, is the Conflictor of the feuding families. Escalus is the voice of authority in Verona. He appears only three times within the text and only to administer justice following major events in the feud between the Capulet and Montague families. He first punishes Capulet and Montague for the quarrel between Tybalt, Benvolio, and a handful of servants. He returns too late to stop the fatal brawls between Tybalt and Mercutio and, subsequently, Tybalt and Romeo. Escalus is prepared to execute Romeo for his offense—Romeo\'s killing Tybalt—but lightens the sentence to lifetime banishment from Verona, when Benvolio insists that Tybalt started the quarrel by murdering Mercutio, a kinsman to the Prince. Prince Escalus returns in the final scene—V.iii—following the double suicide of Romeo and Juliet, and at last orders the lords of the feuding families to make peace.',0,NULL,NULL,'PrinceEscalusthePrinceofVeronai','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192005,30117,165,'The ruling Prince of Verona.',0,NULL,NULL,'TherulingPrinceofVerona','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192006,30117,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192007,30117,167,'Ruling house of Verona',0,NULL,NULL,'RulinghouseofVerona','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192008,30118,1,'Count Paris',0,NULL,NULL,'CountParis','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192009,30118,3,'\"Count Paris is a kinsman of Prince Escalus and seeks to marry Juliet. He is described as handsome, somewhat self-absorbed, and very wealthy.\n\nParis makes his first appearance in Act I, Scene II, where he expresses his wish to make Juliet his wife and the mother of his children. Capulet demurs, citing his daughter\'s young age as a reason and telling him to wait until she is more mature. (Paris disagrees, however.) Nevertheless, Capulet invites Paris to attend a family ball being held that evening and grants permission to woo and attract Juliet. Later in the play, however, Juliet refuses to become Paris\' \"joyful bride\" after her cousin Tybalt dies by her new husband Romeo\'s hand, proclaiming that she now wants nothing to do with Paris. Her parents threaten to disown (or cut ties with) her if she will not agree to the marriage. Then, while at Laurence\'s cell at the church, Paris tries to woo her by repeatedly saying that she is his wife and that they are to be married on Thursday. He kisses her and then leaves the cell, prompting Juliet to angrily threaten to kill herself with a knife. His final appearance in the play is in the cemetery where Juliet is \"laid to rest\" in the Capulet family tomb. Believing her to be dead, Count Paris has come to mourn her death in solitude and privacy and sends his manservant away. He professes his love to Juliet, saying he will nightly weep for her (Act V, Scene III). Shortly thereafter, Romeo arrives. Paris sees him and thinks he is trying to vandalize the tomb, so he tries to arrest him. They fight, and Romeo kills Paris. Romeo grants Paris\' dying wish to be placed next to Juliet in the tomb.\"',0,NULL,NULL,'CountParisisakinsmanofPrinceEsc','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192010,30118,165,'A kinsman of Escalus who wishes to marry Juliet.',0,NULL,NULL,'AkinsmanofEscaluswhowishestomar','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192011,30118,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192012,30118,167,'Ruling house of Verona',0,NULL,NULL,'RulinghouseofVerona','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192013,30119,1,'Mercutio',0,NULL,NULL,'Mercutio','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192014,30119,3,'\"Mercutio is the cousin of Prince Escalus and Count Paris, and is a close friend of Romeo and his cousin Benvolio, The invitation to the Capulet\'s party reveals that he has a brother named Valentine. Mercutio is apt to make long, drawn out speeches (the most famous of which is the Queen Mab speech), and is generally thought to be reckless, a jester, and a free spirit. Due to his reckless and flamboyant personality, Mercutio is one of Shakespeare\'s most popular characters. Mercutio is the instigator of many fights with his rather mean spirited humor, and often insults Tybalt, a renowned swordsman. It is Tybalt\'s temper that leads to Mercutio\'s death, and Romeo\'s banishment and the tragedy that follows.\n\nAfter Romeo receives a death threat from Tybalt, Mercutio expects Romeo to engage Tybalt in a duel. However, Romeo refuses to fight Tybalt, as Tybalt is Juliet\'s cousin and therefore his kinsman. Not knowing this, Mercutio is incensed, and decides to fight Tybalt himself. Romeo, not wanting his best friend or his relative to get hurt, intervenes, causing Mercutio to be killed by Tybalt stabbing under Romeo\'s arm.\n\nBefore he dies, Mercutio casts \"a plague o\' both your houses!\" He makes one final pun before he dies: \"Ask for me tomorrow, and you shall find me a grave man\". In revenge for the murder of his best friend, Romeo slays Tybalt, thus leading to Romeo\'s banishment from Verona and the increasingly tragic turn of events that follows.\"',0,NULL,NULL,'MercutioisthecousinofPrinceEsca','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192015,30119,165,'Another kinsman of Escalus, and a friend of Romeo.',0,NULL,NULL,'AnotherkinsmanofEscalusandafrie','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192016,30119,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192017,30119,167,'Ruling house of Verona',0,NULL,NULL,'RulinghouseofVerona','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192018,30120,1,'Capulet',0,NULL,NULL,'Capulet','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192019,30120,3,'\"Lord Capulet is the patriarch of the Capulet family, the father of Juliet, and uncle of Tybalt. He is very wealthy. He is sometimes commanding but also convivial, as at the ball: when Tybalt tries to incite a duel with Romeo, Capulet tries to calm him and then threatens to throw him out of the family if he does not control his temper; he does the same to his daughter later in the play.\n\nHang thee, young baggage! disobedient wretch!\nI tell thee what: get thee to church o\' Thursday,\nOr never after look me in the face\nAnd you be mine, I\'ll give you to my friend;\nAnd you be not, hang, beg, starve, die in the streets!\n\nCapulet\'s ultimatum to Juliet Romeo and Juliet[2]\nCapulet highly believes he knows what is best for Juliet. He says that his consent to the marriage depends upon what she wants and tells Count Paris that if he wants to marry Juliet he should wait a while then ask her. Later, however, when Juliet is grieving over Romeo\'s being sent away, Capulet thinks her sorrow is due to Tybalt\'s death, and in a misguided attempt to cheer her up, he wants to surprise her by arranging a marriage between her and Count Paris. The catch is that she has to be \"ruled\" by her father and to accept the proposal. When she refuses to become Paris\' \"joyful bride\", saying that she can \"never be proud of what she hates\", Capulet becomes furious; threatens to make her a street urchin; calls her a \"hilding\" , \"unworthy\", \"young baggage\", a \"disobedient wretch\", a \"green-sickness carrion\", and \"tallow-face\"; and says God\'s giving Juliet to them was a \"curse\" and he now realizes he and his wife had one child too many when Juliet was born (in The Tragical History of Romeus and Juliet). In addition to threatening to turn her out, he threatens to sentence her to rot away in prison if she does not obey her parents\' orders. He then storms away, and his wife also rejects Juliet before following him. He fixes the day of the marriage for Thursday and suddenly advances it to Wednesday out of anger and impulse. His actions indicate that his daughter\'s wants were irrelevant all the way up to the point when he sees her unconscious on her bed (presumably dead) and later, when she is truly dead during the play\'s final scene. It is he who asks Lord Montague for his hand to end the feud between their families.\"',0,NULL,NULL,'LordCapuletisthepatriarchoftheC','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192020,30120,165,'The patriarch of the house of Capulet.',0,NULL,NULL,'ThepatriarchofthehouseofCapulet','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192021,30120,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192022,30120,167,'House of Capulet',0,NULL,NULL,'HouseofCapulet','2015-07-07 00:11:46');
INSERT INTO `recDetails` VALUES (192023,30121,1,'Lady Capulet',0,NULL,NULL,'LadyCapulet','2015-07-07 00:11:47');
INSERT INTO `recDetails` VALUES (192024,30121,3,'Capulet\'s wife is the matriarch of the house of Capulet, and Juliet\'s mother. She plays a larger role than Montague\'s wife, appearing in several scenes. In Act 1, Scene 3, she refuses to talk to her daughter about marriage, as she feels uncomfortable about it, but in Scene four, she is pleased about Count Paris\' \"interest\" in her daughter. When Tybalt is killed in Act 3, she expresses extreme grief and a strong desire for revenge on Romeo. In Act 3, Scene 5, she becomes very angry with Juliet for refusing to marry Paris and coldly rejects her, saying: \"Talk not to me, for I\'ll not speak a word; do as thou wilt, for I am done with thee\". By the final act, she is nearly overcome by the tragic events of the play.[3] We know Juliet\'s mother bore her first child by the time she was 14, Juliet\'s age, and her husband is many years older than she. Calling her \"Lady Capulet\" is a modern addition; it is an echo of Juliet\'s form of address in 3.5.65: \"my lady mother\".[4] In the first texts the stage direction and speech headings can be \"mother\", \"wife\", or even \"old lady\", but nowhere \"Lady Capulet\".[4]',0,NULL,NULL,'Capuletswifeisthematriarchofthe','2015-07-07 00:11:47');
INSERT INTO `recDetails` VALUES (192025,30121,165,'The matriarch of the house of Capulet.',0,NULL,NULL,'ThematriarchofthehouseofCapulet','2015-07-07 00:11:47');
INSERT INTO `recDetails` VALUES (192026,30121,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:47');
INSERT INTO `recDetails` VALUES (192027,30121,167,'House of Capulet',0,NULL,NULL,'HouseofCapulet','2015-07-07 00:11:47');
INSERT INTO `recDetails` VALUES (192028,30122,1,'Juliet',0,NULL,NULL,'Juliet','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192029,30122,3,'\"As a younger child, she was cared for by a Nurse, who is now her confidante. Juliet is approaching her 14th birthday. She was born on \"Lammas Eve at night\" (August 1), so Juliet\'s birthday is July 31 (1.3.19). Her birthday is \"a fortnight hence\", putting the action of the play in mid-July (1.3.17).[clarification needed] Her father states that she \"hath not seen the change of fourteen years\" (1.2.9).\n\nJuliet dies at the end of the play, and the sacred lovers are reunited on the same deathbed. Both their families realize what they had done by trying to separate the star crossed lovers with the effect that the Capulets and Montagues are reunited and their fighting ends.\"',0,NULL,NULL,'Asayoungerchildshewascaredforby','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192030,30122,165,'The 13-year-old daughter of Capulet, and the play\'s female protagonist.',0,NULL,NULL,'The13yearolddaughterofCapuletan','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192031,30122,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:48');
