INSERT INTO `recDetails` VALUES (192033,30123,1,'Tybalt',0,NULL,NULL,'Tybalt','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192034,30123,3,'\"Tybalt is Lady Capulet\'s nephew and Juliet\'s hot-headed cousin. As a skilled swordsman, he serves as the story\'s principal antagonist. Tybalt is angered by the insult of Romeo and Benvolio\'s uninvited presence at the ball in the Capulets\' home. Tybalt shares the same name as the character Tibert/Tybalt the \"Prince of Cats\" in Reynard the Fox, a point of both mockery and compliment to him in the play. While Mercutio repeatedly calls Tybalt \"Prince of Cats\" (referring to Tybalt’s speed and agility with the sword), Mercutio is also insulting Tybalt — the phrase refers not only to Reynard but to the Italian word cazzo (pr. CAT-so) meaning “penis.”\n\nTybalt is first seen coming to the aid of his servants who are being attacked by the Montagues\' servants. He is also present at Capulet\'s feast in act one, scene five and is the first to recognize Romeo. His last appearance is in act 3 scene 1, wherein Mercutio insults Tybalt and ends up fighting with him. Tybalt kills Mercutio and, in retaliation, Romeo rages and kills Tybalt, resulting in Romeo\'s banishment.\"',0,NULL,NULL,'TybaltisLadyCapuletsnephewandJu','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192035,30123,165,'A cousin of Juliet, and the nephew of Lady Capulet.',0,NULL,NULL,'AcousinofJulietandthenephewofLa','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192036,30123,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:48');
