INSERT INTO `recDetails` VALUES (192038,30124,1,'The Nurse',0,NULL,NULL,'TheNurse','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192039,30124,3,'The Nurse is a major character in the play, and like the Friar she is a neutral character. There has been speculation about her name, as Capulet refers to as \"Angelica\", but the line can be addressed to either the nurse or Lady Capulet. She is the personal servant (and former nurse) of Juliet\'s. As the primary person who raised Juliet, she is Juliet\'s confidante and effectively more of a mother to the girl than Lady Capulet.[5]',0,NULL,NULL,'TheNurseisamajorcharacterinthep','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192040,30124,165,'Juliet\'s personal attendant and confidante.',0,NULL,NULL,'Julietspersonalattendantandconf','2015-07-07 00:11:48');
