INSERT INTO `recDetails` VALUES (192047,30126,1,'Montague',0,NULL,NULL,'Montague','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192048,30126,3,'The father of Romeo. Presumably, he is also wealthy, and is always in feud with Capulet. Montague clearly loves this son deeply and at the beginning of the play, worries for him as he recounts to Benvolio this attempts to find out the source of his depression. He wishes Benvolio better luck. After Romeo kills Tybalt, Montague pleas to the Prince to spare him of execution as Romeo did only what the law would have done, since Tybalt killed Mercutio. He appears again at the end of the play to mourn Romeo, having already lost his wife to grief.',0,NULL,NULL,'ThefatherofRomeoPresumablyheisa','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192049,30126,165,'The patriarch of the house of Montague.',0,NULL,NULL,'ThepatriarchofthehouseofMontagu','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192050,30126,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192051,30126,167,'House of Montague',0,NULL,NULL,'HouseofMontague','2015-07-07 00:11:48');
INSERT INTO `recDetails` VALUES (192052,30127,1,'Lady Montague',0,NULL,NULL,'LadyMontague','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192053,30127,3,'Montague\'s wife is the matriarch of the house of Montague, and the mother of Romeo and aunt of Benvolio. She appears twice within the play: in act one, scene one she first restrains Montague from entering the quarrel himself, and later speaks with Benvolio about the same quarrel. She returns with her husband and the Prince in act three, scene one to see what the trouble is, and is there informed of Romeo\'s banishment. She dies of grief offstage soon after (mentioned in act five). She is very protective of her son Romeo and is very happy when Benvolio tells her that Romeo was not involved in the brawl that happened between the Capulets and Montagues. As with Capulet\'s wife, calling her \"Lady Montague\" is a later invention not supported by the earliest texts.',0,NULL,NULL,'Montagueswifeisthematriarchofth','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192054,30127,165,'The matriarch of the house of Montague.',0,NULL,NULL,'ThematriarchofthehouseofMontagu','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192055,30127,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192056,30127,167,'House of Montague',0,NULL,NULL,'HouseofMontague','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192057,30128,1,'Romeo',0,NULL,NULL,'Romeo','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192058,30128,3,'In the beginning of the play, Romeo pines for an unrequited love, Rosaline. To cheer him up, his cousin and friend Benvolio and Mercutio take him to the Capulets\' celebration in disguise, where he meets and falls in love with the Capulets\' only daughter, Juliet. Later that night, he and Juliet meet secretly and pledge to marry, despite their families\' long-standing feud. They marry the following day, but their union is soon thrown into chaos by their families; Juliet\'s cousin Tybalt duels and kills Romeo\'s friend Mercutio, throwing Romeo into such a rage that he kills Tybalt, and the Prince of Verona subsequently banishes him. Meanwhile, Juliet\'s father plans to marry her off to Paris, a local aristocrat, within the next few days, threatening to turn her out on the streets if she doesn\'t follow through. Desperate, Juliet begs Romeo\'s confidant, Friar Laurence, to help her to escape the forced marriage. Laurence does so by giving her a potion that puts her in a deathlike coma. The plan works, but too soon for Romeo to learn of it; he genuinely believes Juliet to be dead, and so resolves to commit suicide, by drinking the bottle of poison (illegally bought from the Apothecary upon hearing the news of Juliet\'s \"death\"). Romeo\'s final words were \"Thus with a kiss I die\".[8] He kills himself at Juliet\'s grave, moments before she awakes; she kills herself in turn shortly thereafter.',0,NULL,NULL,'InthebeginningoftheplayRomeopin','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192059,30128,165,'The son of Montague, and the play\'s male protagonist.',0,NULL,NULL,'ThesonofMontagueandtheplaysmale','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192060,30128,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192061,30128,167,'House of Montague',0,NULL,NULL,'HouseofMontague','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192062,30129,1,'Benvolio',0,NULL,NULL,'Benvolio','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192063,30129,3,'He is Montague\'s nephew and Romeo\'s cousin. Benvolio and Romeo are both friends of Mercutio, a kinsman to Prince Escalus. Benvolio seems to have little sympathy with the feud, trying unsuccessfully to back down from a fight with Tybalt, and the duels that end in Mercutio and Tybalt\'s death. Benvolio spends most of Act I attempting to distract his cousin from his infatuation with Rosaline, but following the first appearance of Mercutio in I.iv, he and Mercutio become more closely aligned until III.i. In that scene, he drags the fatally wounded Mercutio offstage, before returning to inform Romeo of Mercutio\'s death and the Prince of the course of Mercutio\'s and Tybalt\'s deaths. Benvolio then disappears from the play (though, as a Montague, he may implicitly be included in the stage direction in the final scene \"Enter Lord Montague and others\", and he is sometimes doubled with Balthasar). Though he ultimately disappears from the play without much notice, he is a crucial character if only in that he is the only child of the new generation from either family to survive the play (as Romeo, Juliet, Paris, Mercutio, and Tybalt are dead).',0,NULL,NULL,'HeisMontaguesnephewandRomeoscou','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192064,30129,165,'Romeo\'s cousin and best friend.',0,NULL,NULL,'Romeoscousinandbestfriend','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192065,30129,166,'30107',0,NULL,NULL,'30107','2015-07-07 00:11:49');
