INSERT INTO `recDetails` VALUES (192067,30130,1,'Balthasar',0,NULL,NULL,'Balthasar','2015-07-07 00:11:49');
INSERT INTO `recDetails` VALUES (192068,30130,3,'Balthasar is Romeo\'s servant and trusted friend. They have a brotherly relationship, which is identified when Balthasar tells Romeo Juliet is \"dead.\" While he is not directly referenced in the first scene of the play, the directions call for two Montague servants to quarrel with Sampson and Gregory. He then comes back in Act V Scene 1 telling Romeo about Juliet\'s death. Later Friar Laurence runs past Balthasar and asks him where Romeo is. Balthasar tells him that he is inside the tomb. Then the Prince calls him in and asks him questions about why was he there. He gives the Prince the letter that explains why Romeo killed himself.',0,NULL,NULL,'BalthasarisRomeosservantandtrus','2015-07-07 00:11:49');
