INSERT INTO `recDetails` VALUES (192072,30131,1,'Friar Laurence',0,NULL,NULL,'FriarLaurence','2015-07-07 00:11:50');
INSERT INTO `recDetails` VALUES (192073,30131,3,'\"Friar Laurence plays the part of an advisor and mentor to Romeo, along with aiding in major plot developments.\n\nAlone, the innocent Friar gives us foreshadowing with his soliloquy about plants and their similarities to humans.[9] When Romeo requests that the Friar marry him to Juliet, he is shocked, because only days before, Romeo had been infatuated with Rosaline,[10] a woman who did not return his love. Nevertheless, Friar Laurence decides to marry Romeo and Juliet in the attempt to end the civil feud between the Capulets and the Montagues.[11]\n\nWhen Romeo is banished[12] and flees to Mantua for murdering Tybalt[13] (who had previously murdered Mercutio), he tries to help the two lovers get back together using a death-emulating potion to fake Juliet\'s death.[14] The friar\'s letter to Romeo does not reach him because the people of Mantua suspect the messenger came from a house where the plague reigns,[15] and the Friar is unable to arrive at the Capulet\'s monument in time. Romeo kills Count Paris,[16] whom he finds weeping near Juliet\'s corpse, then commits suicide,[17] by drinking poison that he bought from an impoverished apothecary,[18] over what he thinks is Juliet\'s dead body. Friar Laurence arrives just as Juliet awakes from her chemically induced slumber.[19] He urges Juliet not to be rash, and to join a society of nuns,[20] but he hears a noise from outside and then flees from the tomb. Juliet then kills herself with Romeo\'s dagger, completing the tragedy. The Friar is forced to return to the tomb, where he recounts the entire story to Prince Escalus, and all the Montagues and Capulets. As he finishes, the prince proclaims, \"We have still known thee for a holy man\".\"',0,NULL,NULL,'FriarLaurenceplaysthepartofanad','2015-07-07 00:11:50');
INSERT INTO `recDetails` VALUES (192074,30131,165,'A Franciscan friar, and is Romeo\'s confidant.',0,NULL,NULL,'AFranciscanfriarandisRomeosconf','2015-07-07 00:11:50');
