INSERT INTO `recDetails` VALUES (192077,30132,3,'Friar John calls at the door of Friar Laurence\'s cell, \"Holy Franciscan friar! brother, ho!\" (5.2.1). Friar Laurence comes out and immediately asks about Romeo: \"Welcome from Mantua! What says Romeo? / Or, if his mind be writ, give me his letter\" (5.2.3-4). Friar John explains that he sought out another friar for company and found him in a house where he was visiting the sick, whereupon the health authorities, fearing there was pestilence in the house, confined both friars in the house so they wouldn\'t infect others. The authorities wouldn\'t even allow Friar John to use a messenger to send the letter back to Friar Laurence.',0,NULL,NULL,'FriarJohncallsatthedoorofFriarL','2015-07-07 00:11:50');
