INSERT INTO `recDetails` VALUES (192084,30134,3,'\"The Chorus is an omniscient character. It appears at the top of the play to fill the audience in on the ancient quarrel between the, \"Two households, both alike in dignity / In fair Verona, where we lay our scene\". It returns as a prologue to act two to foreshadow the tragic turn of events about to befall the new romance between the title characters.\n\nThe Chorus only appears in the Quarto versions, not in the First Folio.\"',0,NULL,NULL,'TheChorusisanomniscientcharacte','2015-07-07 00:11:51');
