INSERT INTO `recDetails` VALUES (192105,30135,3,'Lord Macbeth is the title character and protagonist of William Shakespeare\'s Macbeth (c. 1603–1607). The character is based on the historical king Macbeth of Scotland, and is derived largely from the account in Holinshed\'s Chronicles (1587), a history of Britain.\n\nHe is portrayed throughout the play as an antihero. Macbeth is a Scottish noble and a valiant military man. After a supernatural prophecy, and at the urging of his wife, Lady Macbeth, he commits regicide and becomes King of Scotland. He thereafter lives in anxiety and fear, unable to rest or to trust his nobles. He leads a reign of terror until defeated by his former ally Macduff. The throne is then restored to the rightful heir, the murdered King Duncan\'s son, Malcolm.',0,NULL,NULL,'LordMacbethisthetitlecharactera','2015-07-07 03:45:14');
INSERT INTO `recDetails` VALUES (192106,30136,3,'Lady Macbeth is a character in Shakespeare\'s Macbeth (c.1603–1607). She is the wife to the play\'s protagonist, Macbeth, a Scottish nobleman. After goading him into committing regicide, she becomes Queen of Scotland, but later suffers pangs of guilt for her part in the crime. She dies off-stage in the last act, an apparent suicide.\n\nAccording to some genealogists, Lady Macbeth and King Duncan\'s wife were siblings or cousins, where Duncan\'s wife had a stronger claim to the throne than Lady Macbeth. It was this that incited her jealousy and hatred of Duncan.\n\nThe character\'s origins lie of the accounts of Kings Duff and Duncan in Holinshed\'s Chronicles (1587), a history of Britain familiar to Shakespeare. Shakespeare\'s Lady Macbeth appears to be a composite of two separate and distinct personages in Holinshed\'s work: Donwald\'s nagging, murderous wife in the account of King Duff, and Macbeth\'s ambitious wife Gruoch of Scotland in the account of King Duncan.\n\nLady Macbeth is a powerful presence in the play, most notably in the first two acts. Following the murder of King Duncan, however, her role in the plot diminishes. She becomes an uninvolved spectator to Macbeth\'s plotting, and a nervous hostess at a banquet dominated by her husband\'s hallucinations. Her fifth act sleepwalking scene is a turning point in the play, and her line, \"Out, damned spot!,\" has become a phrase familiar to many speakers of the English language. The report of her death late in the fifth act provides the inspiration for Macbeth\'s \"Tomorrow and tomorrow and tomorrow\" speech.\n\nAnalysts see in the character of Lady Macbeth the conflict between femininity and masculinity, as they are impressed in cultural norms. Lady Macbeth suppresses her instincts toward compassion, motherhood, and fragility — associated with femininity — in favour of ambition, ruthlessness, and the singleminded pursuit of power. This conflict colours the entire drama, and sheds light on gender-based preconceptions from Shakespearean England to the present.\n\nThe role has attracted countless notable actresses over the centuries, including Sarah Siddons, Charlotte Melmoth, Helen Faucit, Ellen Terry, Vivien Leigh, Vivien Merchant, Glenda Jackson, Francesca Annis, Judith Anderson, Renée O\'Connor, Judi Dench, Tabu, Keeley Hawes and Marion Cotillard. Jeanette Nolan played the character in Orson Welles\' 1948 film adaptation.',0,NULL,NULL,'LadyMacbethisacharacterinShakes','2015-07-07 03:45:54');
INSERT INTO `recDetails` VALUES (192107,30137,3,'Lord Banquo, Thane of Lochaber, is a character in William Shakespeare\'s 1606 play Macbeth. In the play, he is at first an ally to Macbeth (both are generals in the King\'s army) and they are together when they meet the Three Witches. After prophesying that Macbeth will become king, the witches tell Banquo that he will not be king himself, but that his descendants will be. Later, Macbeth in his lust for power sees Banquo as a threat and has him murdered; Banquo\'s son, Fleance, escapes. Banquo\'s ghost returns in a later scene, causing Macbeth to react with alarm during a public feast.\n\nShakespeare borrowed the character of Banquo from Holinshed\'s Chronicles, a history of Britain published by Raphael Holinshed in 1587. In Chronicles Banquo is an accomplice to Macbeth in the murder of the king, rather than a loyal subject of the king who is seen as an enemy by Macbeth. Shakespeare may have changed this aspect of his character in order to please King James, who was thought at the time to be a descendant of the real Banquo. Critics often interpret Banquo\'s role in the play as being a foil to Macbeth, resisting evil where Macbeth embraces it. Sometimes, however, his motives are unclear, and some critics question his purity. He does nothing to accuse Macbeth of murdering the king, even though he has reason to believe Macbeth is responsible.',0,NULL,NULL,'LordBanquoThaneofLochaberisacha','2015-07-07 03:46:40');
INSERT INTO `recDetails` VALUES (192108,30138,3,'Lord Macduff, the Thane of Fife, is a character in William Shakespeare\'s Macbeth (c.1603-1607). Macduff plays a pivotal role in the play: he suspects Macbeth of regicide and eventually kills Macbeth in the final act. He can be seen as the avenging hero who helps save Scotland from Macbeth\'s tyranny in the play.\n\nThe character is first known from Chronica Gentis Scotorum (late 14th century) and Orygynale Cronykil of Scotland (early 15th century). Shakespeare drew mostly from Holinshed\'s Chronicles (1587).\n\nAlthough characterized sporadically throughout the play, Macduff serves as a foil to Macbeth and a figure of morality.',0,NULL,NULL,'LordMacdufftheThaneofFifeisacha','2015-07-07 03:47:14');
INSERT INTO `recDetails` VALUES (192109,30139,3,'Siward or Sigurd (Old English: Sigeweard)[1] was an important earl of 11th-century northern England. The Old Norse nickname Digri and its Latin translation Grossus (\"the stout\") are given to him by near-contemporary texts.[2] Siward was probably of Scandinavian origin, perhaps a relative of Earl Ulf, and emerged as a powerful regional strongman in England during the reign of Cnut (\"Canute the Great\", 1016–1035). Cnut was a Scandinavian ruler who conquered England in the 1010s, and Siward was one of the many Scandinavians who came to England in the aftermath of that conquest. Siward subsequently rose to become sub-ruler of most of northern England. From 1033 at the latest Siward was in control of southern Northumbria, that is, present-day Yorkshire, governing as earl on Cnut\'s behalf.\n',0,NULL,NULL,'SiwardorSigurdOldEnglishSigewea','2015-07-07 03:47:59');
INSERT INTO `recDetails` VALUES (192110,30140,3,'Hecate or Hekate (/ˈhɛkətiː, ˈhɛkɪt/; Greek Ἑκάτη, Hekátē) is a goddess in Greek religion and mythology, most often shown holding two torches or a key[1] and in later periods depicted in triple form. She was variously associated with crossroads, entrance-ways, dogs, light, the moon, magic, witchcraft, knowledge of herbs and poisonous plants, ghosts, necromancy, and sorcery.[2][3] In the post-Christian writings of the Chaldean Oracles (2nd-3rd century CE) she was regarded with (some) rulership over earth, sea and sky, as well as a more universal role as Saviour (Soteira), Mother of Angels and the Cosmic World Soul.[4][5] She was one of the main deities worshiped in Athenian households as a protective goddess and one who bestowed prosperity and daily blessings on the family.[6]\n\nHecate may have originated among the Carians of Anatolia, where variants of her name are found as names given to children. William Berg observes, \"Since children are not called after spooks, it is safe to assume that Carian theophoric names involving hekat- refer to a major deity free from the dark and unsavoury ties to the underworld and to witchcraft associated with the Hecate of classical Athens.\"[7] She also closely parallels the Roman goddess Trivia, with whom she was identified in Rome.',0,NULL,NULL,'HecateorHekateˈhɛkətiːˈhɛkɪtGre','2015-07-07 03:48:30');
