INSERT INTO `recDetails` VALUES (192112,30141,3,'Leir was a legendary king of the Britons whose story was recounted or invented by Geoffrey of Monmouth in his pseudohistorical 12th-century History of the Kings of Britain.[1] According to Geoffrey\'s genealogy of theBritish dynasty, Leir\'s reign would have occurred around the 8th century bc. The story was modified and retold by William Shakespeare in his Elizabethan tragedy King Lear.[2]',0,NULL,NULL,'LeirwasalegendarykingoftheBrito','2015-07-07 03:58:01');
