INSERT INTO `recDetails` VALUES (192124,30144,3,'Cordelia is a fictional character in William Shakespeare’s tragic play, King Lear. She is the youngest of King Lear’s three daughters, and his favourite. After her elderly father offers her the opportunity to profess her love to him in return for one third of the land in his kingdom, she refuses and is banished for the majority of the play.',0,NULL,NULL,'Cordeliaisafictionalcharacterin','2015-07-07 03:58:01');
