INSERT INTO `recDetails` VALUES (192182,30159,1,'Othello',0,NULL,NULL,'Othello','2015-07-11 19:55:28');
INSERT INTO `recDetails` VALUES (192183,30159,3,'Othello is a character in Shakespeare\'s Othello (c. 1601–1604). The character\'s origin is traced to the tale \"Un Capitano Moro\" in Gli Hecatommithi by Giovanni Battista Giraldi Cinthio. There, he is simply referred to as the Moor... / Othello is a brave and competent soldier of advanced years and Moorish background in the service of the Venetian Republic. He elopes with Desdemona, the beautiful daughter of a respected Venetian senator. After being deployed to Cyprus, Othello is manipulated by his Ancient (pronounced Ensign) Iago, into believing Desdemona is an adultress. Othello murders her and, upon discovering Iago\'s deceit, kills himself. /Othello was first mentioned in a Revels account of 1604 when the play was performed on 1 November at Whitehall Palace with Richard Burbage almost certainly Othello\'s first interpreter. Modern notable performers of the role include Paul Robeson, Orson Welles, Richard Burton, James Earl Jones, Laurence Fishburne, and Laurence Olivier.',0,NULL,NULL,'OthelloisacharacterinShakespear','2015-07-11 19:55:28');
INSERT INTO `recDetails` VALUES (192184,30159,165,'General in the Venetian military',0,NULL,NULL,'GeneralintheVenetianmilitary','2015-07-11 19:55:28');
