INSERT INTO `recDetails` VALUES (192186,30160,1,'Desdemona',0,NULL,NULL,'Desdemona','2015-07-11 19:55:28');
INSERT INTO `recDetails` VALUES (192187,30160,3,'Desdemona is a character in William Shakespeare\'s play Othello (c. 1601–1604). Shakespeare\'s Desdemona is a Venetian beauty who enrages and disappoints her father, a Venetian senator, when she elopes with Othello, a man several years her senior. When her husband is deployed to Cyprus in the service of the Republic of Venice, Desdemona accompanies him. There, her husband is manipulated by his ensign Iago into believing she is an adulteress, and, in the last act, she is murdered by her estranged spouse. / The role has attracted notable actresses through the centuries and has the distinction of being the role performed by Margaret Hughes, the first actress to appear on an English public stage.',0,NULL,NULL,'DesdemonaisacharacterinWilliamS','2015-07-11 19:55:28');
INSERT INTO `recDetails` VALUES (192188,30160,165,'Othello\'s wife',0,NULL,NULL,'Othelloswife','2015-07-11 19:55:28');
