INSERT INTO `recDetails` VALUES (192190,30161,1,'Iago',0,NULL,NULL,'Iago','2015-07-11 19:55:28');
INSERT INTO `recDetails` VALUES (192191,30161,3,'Iago is a fictional character in Shakespeare\'s Othello (c. 1601–1604). The play\'s main antagonist, Iago is the \'Ancient\' (standard bearer) of General Othello as well as being husband of Emilia, who is in turn the attendant of Othello\'s wife Desdemona. Iago hates Othello (who is also known as \"The Moor\") and devises a plan to destroy him by making him believe that his wife is having an affair with his lieutenant, Michael Cassio. / The role is thought to have been first played by Robert Armin, who typically played intelligent clown roles like Touchstone in As You Like It or Feste in Twelfth Night.[1] / The character\'s source is traced to Giovanni Battista Giraldi Cinthio\'s tale \"Un Capitano Moro\" in Gli Hecatommithi (1565). There, the character is simply \"the ensign\".',0,NULL,NULL,'IagoisafictionalcharacterinShak','2015-07-11 19:55:28');
INSERT INTO `recDetails` VALUES (192192,30161,165,'Othello\'s captain, always jealous about things',0,NULL,NULL,'Othelloscaptainalwaysjealousabo','2015-07-11 19:55:28');
