INSERT INTO `recDetails` VALUES (192194,30162,1,'Michael Cassio',0,NULL,NULL,'MichaelCassio','2015-07-11 19:55:29');
INSERT INTO `recDetails` VALUES (192195,30162,3,'Michael Cassio, or simply Cassio, is a fictional character in William Shakespeare\'s Othello. The source of the character is the 1565 tale \"Un Capitano Moro\" by Cinthio; Cassio is unnamed in Cinthio but referred to as \"the squadron leader\". In the play, Cassio is a young and handsome lieutenant under Othello\'s command who becomes one of Iago\'s several victims in a plot to ruin Othello.',0,NULL,NULL,'MichaelCassioorsimplyCassioisaf','2015-07-11 19:55:29');
INSERT INTO `recDetails` VALUES (192196,30162,165,'Othello\'s most loved captain',0,NULL,NULL,'Othellosmostlovedcaptain','2015-07-11 19:55:29');
