INSERT INTO `recDetails` VALUES (192202,30164,1,'Bianca',0,NULL,NULL,'Bianca','2015-07-11 19:55:30');
INSERT INTO `recDetails` VALUES (192203,30164,3,'Bianca is a fictional character in William Shakespeare\'s Othello (c. 1601–1604). She is Cassio\'s jealous lover. Despite her brief appearance on stage, Bianca plays a significant role in the progress of Iago\'s scheme to incite Othello\'s jealousy of Cassio. Bianca is traditionally regarded as a courtesan, although this occupation is not specifically designated in the drama. The character was occasionally cut from performances in the 19th century on moral grounds.[1] Bianca is not to be confused with Bianca Minola in Shakespeare\'s The Taming of the Shrew.',0,NULL,NULL,'BiancaisafictionalcharacterinWi','2015-07-11 19:55:30');
