INSERT INTO `recDetails` VALUES (192206,30165,1,'Brabantio',0,NULL,NULL,'Brabantio','2015-07-11 19:55:30');
INSERT INTO `recDetails` VALUES (192207,30165,3,'Brabantio (sometimes called Brabanzio) is a character in William Shakespeare\'s Othello (c.1601–1604). He is a Venetian senator and the father of Desdemona. He has entertained Othello in his home countless times before the play opens, thus giving Othello and Desdemona opportunity to fall in love. He is furious upon learning they have eloped, and Desdemona\'s decision is reported to be the cause of his death in the last act. The character has no counterpart in Shakespeare\'s source material for the play but is apparently the Bard\'s complete invention. He appears in the first act only and is mentioned in the fifth.',0,NULL,NULL,'BrabantiosometimescalledBrabanz','2015-07-11 19:55:30');
INSERT INTO `recDetails` VALUES (192208,30165,165,'Venetian senator and Desdemona\'s father',0,NULL,NULL,'VenetiansenatorandDesdemonasfat','2015-07-11 19:55:30');
