INSERT INTO `recDetails` VALUES (192210,30166,1,'Roderigo',0,NULL,NULL,'Roderigo','2015-07-11 19:55:30');
INSERT INTO `recDetails` VALUES (192211,30166,3,'Roderigo is a fictional character in Shakespeare\'s Othello (c.1601-1604), where he serves as the secondary antagonist of the play. He is a dissolute Venetian lusting after Othello\'s wife Desdemona. Roderigo has opened his purse to Iago in the mistaken belief that Iago is using his money to pave the way to Desdemona\'s bed. When the assassination of Michael Cassio runs amiss, Iago fatally wounds Roderigo. / Shakespeare\'s source for Othello was the tale \"Un Capitano Moro\" by Cinthio, and, while Shakespeare closely followed his source in composing Othello, Roderigo has no counterpart in Cinthio. The character is completely Shakespeare\'s invention.',0,NULL,NULL,'Roderigoisafictionalcharacterin','2015-07-11 19:55:30');
