INSERT INTO `recDetails` VALUES (192214,30167,1,'Doge of Venice',0,NULL,NULL,'DogeofVenice','2015-07-11 19:55:30');
INSERT INTO `recDetails` VALUES (192215,30167,3,'The Doge of Venice (/ˈdoʊdʒ/; Venetian: Doxe de Venexia [ˈdɔːze]; Italian: Doge di Venezia Italian pronunciation: [ˈdɔːdʒe]; all derived from Latin dūx, \"military leader\"), sometimes translated as Duke (cf. Italian Duca), was the chief magistrate and leader of the Most Serene Republic of Venice for over a thousand years. Doges of Venice were elected for life by the city-state\'s aristocracy. Commonly the man selected as Doge was the shrewdest elder in the city. The doge was not a duke in the modern sense, nor was a doge the equivalent of a hereditary duke. The \"doge\" was the senior-most elected official of Venice and Genoa; both cities were republics and elected doges. A doge was referred to variously by the titles \"My Lord the Doge\" (Monsignor el Doxe), \"Most Serene Prince\" (Serenissimo Principe), and \"His Serenity\" (Sua Serenità).',0,NULL,NULL,'TheDogeofVeniceˈdoʊdʒVenetianDo','2015-07-11 19:55:30');
