INSERT INTO `recDetails` VALUES (192218,30168,3,'The Merchant of Venice is a play by William Shakespeare in which a merchant in 16th century Venice must default on a large loan provided by an abused Jewish moneylender. It is believed to have been written between 1596 and 1598. Though classified as a comedy in the First Folio and sharing certain aspects with Shakespeare\'s other romantic comedies, the play is perhaps most remembered for its dramatic scenes, and is best known for Shylock and the famous \"Hath not a Jew eyes?\" speech. Also notable is Portia\'s speech about \"the quality of mercy\".',0,NULL,NULL,'TheMerchantofVeniceisaplaybyWil','2015-07-11 19:55:30');
