INSERT INTO `recDetails` VALUES (192312,30188,3,'Gaius Marcius (Caius Martius) Coriolanus (/ˌkɔriəˈleɪnəs, ˌkɒr-/) was a Roman general who is said to have lived in the 5th century BC. He received his toponymic cognomen \"Coriolanus\" because of his exceptional valor in a Roman siege of the Volscian city of Corioli. He was subsequently exiled from Rome, and led troops of Rome\'s enemy the Volsci to besiege Rome.\n\nIn later ancient times, it was generally accepted by historians that Coriolanus was a real historical individual, and a consensus narrative story of his life appeared, retold by leading historians such as Livy, Plutarch, and Dionysius of Halicarnassus. More recent scholarship has cast doubt on the historicity of Coriolanus, portraying him as either a wholly legendary figure or at least disputing the accuracy of the conventional story of his life or the timing of the events.[1]\n\nAccording to Plutarch, his ancestors included prominent patricians such as Censorinus and even an early King of Rome.\n\nThe story is the basis for the tragedy of Coriolanus, written by William Shakespeare, and a number of other works, including Beethoven\'s Coriolan Overture.',0,NULL,NULL,'GaiusMarciusCaiusMartiusCoriola','2015-07-18 18:56:51');
INSERT INTO `recDetails` VALUES (192313,30188,165,'Soon to be Caius Marcius Coriolanus, he is a high ranking Roman soldier',0,NULL,NULL,'SoontobeCaiusMarciusCoriolanush','2015-07-18 18:56:51');
