INSERT INTO `recDetails` VALUES (192372,30205,3,'Bardolph is a fictional character who appears in four plays by William Shakespeare. He is a thief who forms part of the entourage of Sir John Falstaff. His grossly inflamed nose and constantly flushed, carbuncle-covered face is a repeated subject for Falstaff\'s and Prince Hal\'s comic insults and word-play. Though his role in each play is minor, he often adds comic relief, and helps illustrate the personality change in Henry from Prince to King.[1]',0,NULL,NULL,'Bardolphisafictionalcharacterwh','2015-07-12 23:52:02');
