INSERT INTO `recDetails` VALUES (192439,30224,3,'Henry IV (15 April 1367[1] – 20 March 1413) was King of England and Lord of Ireland from 1399 to 1413. He was the tenth king of the House of Plantagenet and also asserted his grandfather\'s claim to the Kingdom of France. He was born at Bolingbroke Castle in Lincolnshire, hence his other name, Henry of Bolingbroke /ˈbɒlɪŋbrʊk/. His father, John of Gaunt, was the third son of Edward III, and enjoyed a position of considerable influence during much of the reign of Henry\'s cousin Richard II, whom Henry eventually deposed. Henry\'s mother was Blanche, heiress to the considerable Lancaster estates, and thus he became the first King of England from the Lancaster branch of the Plantagenets.',0,NULL,NULL,'HenryIV15April13671–20March1413','2015-07-12 23:52:05');
