INSERT INTO `recDetails` VALUES (192447,30230,3,'John Heminges (sometimes spelled Heming, Heminge, Hemminge or Hemings) (bapt. 25 November 1556 – 10 October 1630) was an English Renaissance actor.[1][2] Most noted now as one of the editors of William Shakespeare\'s 1623 First Folio, Heminges served in his time as an actor and financial manager for the King\'s Men.',0,NULL,NULL,'JohnHemingessometimesspelledHem','2015-07-14 00:06:51');
