INSERT INTO `recDetails` VALUES (192453,30229,3,'Mr. William Shakespeares Comedies, Histories, & Tragedies is the 1623 published collection of William Shakespeare\'s plays. Modern scholars commonly refer to it as the First Folio.[1]\n\nPrinted in folio format and containing 36 plays (see list of Shakespeare\'s plays), it was prepared by Shakespeare\'s colleagues John Heminges and Henry Condell. It was dedicated to the \"incomparable pair of brethren\" William Herbert, 3rd Earl of Pembroke and his brother Philip Herbert, Earl of Montgomery (later 4th Earl of Pembroke).\n\nAlthough eighteen of Shakespeare\'s plays had been published in quarto prior to 1623, the First Folio is the only reliable text for about twenty of the plays, and a valuable source text even for many of those previously published. The Folio includes all of the plays generally accepted to be Shakespeare\'s, with the exception of Pericles, Prince of Tyre, The Two Noble Kinsmen, and the two lost plays, Cardenio and Love\'s Labour\'s Won.',0,NULL,NULL,'MrWilliamShakespearesComediesHi','2015-07-14 00:07:33');
INSERT INTO `recDetails` VALUES (192454,30229,4,'The contents of the First Folio were compiled by Heminges and Condell;[2] the members of the Stationers Company who published the book were the booksellers Edward Blount and the father/son team of William and Isaac Jaggard. The Jaggards were printers as well as booksellers, an unusual but not unprecedented combination. William Jaggard has seemed an odd choice by the King\'s Men, since he had published the questionable collection The Passionate Pilgrim as Shakespeare\'s, and in 1619 had printed new editions of ten Shakespearean quartos to which he did not have clear rights, some with false dates and title pages (the False Folio affair). Heminges and Condell emphasised that the Folio was replacing the earlier publications, which they characterised as \"stol\'n and surreptitious copies, maimed and deformed by frauds and stealths of injurious impostors\", asserting that Shakespeare\'s true words \"are now offer\'d to your view cured, and perfect of their limbes; and all the rest, absolute in their numbers as he conceived them.\"\n\nThe paper industry in England was then in its infancy and the quantity of quality rag paper for the book was imported from France.[3] It is thought that the typesetting and printing of the First Folio was such a large job that the King\'s Men simply needed the capacities of the Jaggards\' shop. William Jaggard was old, infirm and blind by 1623, and died a month before the book went on sale; most of the work in the project must have been done by his son Isaac.\n\n\nComparison of the \"To be, or not to be\" soliloquy in the first three editions of Hamlet, showing the varying quality of the text in the Bad Quarto, the Good Quarto and the First Folio\nThe First Folio\'s publishing syndicate also included two stationers who owned the rights to some of the individual plays that had been previously printed: William Aspley (Much Ado About Nothing and Henry IV, Part 2) and John Smethwick (Love\'s Labour\'s Lost, Romeo and Juliet, and Hamlet). Smethwick had been a business partner of another Jaggard, William\'s brother John.\n\nThe printing of the Folio was probably done between February 1622 and early November 1623.[4] The printer originally expected to have the book ready early, since it was listed in the Frankfurt Book Fair catalogue as a book to appear between April and October 1622.[5][6] The first impression had a publication date of 1623, and the earliest record of a retail purchase is an account book entry for 5 December 1623 of Edward Dering (who purchased two); the Bodleian Library, in Oxford, received its copy in early 1624 (which it subsequently sold for £24 as a superseded edition when the Third Folio became available in 1664).[7]',0,NULL,NULL,'ThecontentsoftheFirstFoliowerec','2015-07-14 00:30:43');
