INSERT INTO `recDetails` VALUES (192459,30232,3,'The Second Folio appeared in 1632. Isaac Jaggard had died in 1627, and Edward Blount had transferred his rights to stationer Robert Allot in 1630. The Second Folio was published by Allot, William Aspley, Richard Hawkins, Richard Meighen, and John Smethwick, and printed by Thomas Cotes. It contained the same plays as the First Folio and much of the same additional material, with the addition of an unsigned poem by John Milton.[4]',0,NULL,NULL,'TheSecondFolioappearedin1632Isa','2015-07-14 00:12:43');
