INSERT INTO `recDetails` VALUES (192509,30244,3,'In Greek mythology, Hippolyta (/hɪˈpɒlɪˌtə/; Greek: Ἱππολύτη Hippolyte) was the Amazonian queen who possessed a magical girdle she was given by her father Ares, the god of war. The girdle was a waist belt that signified her authority as queen of the Amazons. She figures prominently in the myths of both Heracles and Theseus. As such, the stories about her are varied enough that they may actually be about several different characters.',0,NULL,NULL,'InGreekmythologyHippolytahɪˈpɒl','2015-07-15 22:07:50');
