INSERT INTO `recDetails` VALUES (192518,30247,3,'Peter Quince is a character in William Shakespeare\'s A Midsummer Night\'s Dream. He is one of the six mechanicals of Athens who perform the play which Quince himself authored, \"The Most Lamentable Comedy and Most Cruel Death of Pyramus and Thisbe\" for the Duke Theseus and his wife Hippolyta at their wedding.\n\nOberon\'s Fairies also watch from a distance: Moth, Peaseblossom, Cobweb and Mustardseed. His name is derived from \"quines\" or \"quoins\", which are wooden wedges used by carpenters.',0,NULL,NULL,'PeterQuinceisacharacterinWillia','2015-07-15 22:23:25');
