INSERT INTO `recDetails` VALUES (192522,30248,3,'Nick Bottom is a character in Shakespeare\'s A Midsummer Night\'s Dream who provides comic relief throughout the play. He is famously known for getting his head transformed into that of a donkey by the elusive Puck. Bottom and Puck are the only two characters who conversate with and progress the three central stories in the whole play. Puck is first introduced in the fairies\' story and creates the drama of the lovers\' story by messing up who loves whom, and places the donkey\'s head on Bottom\'s in his story. Similarly, Bottom is performing in a play in his story intending it to be presented in the lovers\' story, as well as interacting with Titania in the fairies\' story.',0,NULL,NULL,'NickBottomisacharacterinShakesp','2015-07-15 20:58:18');
