INSERT INTO `recDetails` VALUES (192526,30249,3,'Francis Flute is a character from Athens in the play A Midsummer Night\'s Dream. His occupation is a bellows-mender. He is forced to play the female role of Thisbe in \"Pyramus and Thisbe\", a play within the play which is performed for Theseus\' marriage celebration.\n\nIn the play Flute (Thisbe) speaks through the wall (Tom Snout) to Nick Bottom (Pyramus).\n\nFlute is an excited actor who is disappointed when he finds he is meant to play a woman (Thisbe) in their interlude before the duke and the duchess. He generally is portrayed using a falsetto voice. He is an unsure actor.',0,NULL,NULL,'FrancisFluteisacharacterfromAth','2015-07-15 22:06:00');
