INSERT INTO `recDetails` VALUES (192530,30250,3,'Robin Starveling is a character in William Shakespeare\'s A Midsummer Night\'s Dream (1596), one of the Rude Mechanicals of Athens who plays the part of Moonshine in their performance of Pyramus and Thisbe. His part is often considered one of the more humorous in the play, as he uses a lantern in a failed attempt to portray Moonshine and is wittily derided by his audience. Scholars have argued that his amateur performance communicates many of the problems Shakespeare would have been familiar with in the theatre: heckling, lack of adequate props, and amateur acting abilities.[citation needed]',0,NULL,NULL,'RobinStarvelingisacharacterinWi','2015-07-15 20:58:18');
