INSERT INTO `recDetails` VALUES (192546,30254,3,'Demetrius is one of the iconic lovers in William Shakespeare\'s play. A Midsummer Night\'s Dream. He is a young Athenian man who is engaged to a young Athenian girl named Helena. He abandons Helena, a woman whom he has courted and pursues Hermia, whose father Egeus finds Demetrius to be the better suitor. However, Hermia does not love Demetrius, but instead she loves a man called Lysander. Demetrius\'s obstinate pursuit of Hermia throws love out of balance among the Athenian lovers. He eventually comes to his senses, due to a love potion given to him by fairies, and returns Helena\'s love. The storyline is complex and it shows the difficulties of true love through comedy.',0,NULL,NULL,'Demetriusisoneoftheiconiclovers','2015-07-15 20:58:19');
