INSERT INTO `recDetails` VALUES (192550,30255,3,'Philostrate (meaning \"lover of battle\"[1]) is a fictional character in a number of literary works,[2] including William Shakespeare\'s A Midsummer Night\'s Dream (1596). In that play, he is the Master of Revels at Theseus\' court, meaning he is in charge of his lord\'s entertainments, making recommendations to Theseus, as well as altering the text of some of the plays performed in his court. Shakespeare may have used this character to poke fun at play censorship in London at the time. In early performances of the play, the actor who played this character probably also played the part of Egeus, Hermia\'s strict father. There is only one scene in Act V where both Egeus and Philostrate are present, and in this scene Egeus\' character would have taken all of Philostrate\'s lines as his own.',0,NULL,NULL,'Philostratemeaningloverofbattle','2015-07-15 20:58:19');
