INSERT INTO `recDetails` VALUES (192565,30259,3,'Egeus /iˈdʒiːəs/ is a character in A Midsummer Night\'s Dream, the comedy by William Shakespeare. He is an Athenian who tries to keep his daughter, Hermia, from marrying Lysander the man she loves. In original performances, the actor for his role probably played the part of Philostrate as well.',0,NULL,NULL,'EgeusiˈdʒiːəsisacharacterinAMid','2015-07-15 20:58:20');
