INSERT INTO `recDetails` VALUES (192592,30058,3,'Early editors of Shakespeare\'s works, beginning with Nicholas Rowe (1709) and Lewis Theobald (1733), combined material from the two earliest sources of Hamlet available at the time, Q2 and F1. Each text contains material that the other lacks, with many minor differences in wording: scarcely 200 lines are identical in the two. Editors have combined them in an effort to create one \"inclusive\" text that reflects an imagined \"ideal\" of Shakespeare\'s original. Theobald\'s version became standard for a long time,[40] and his \"full text\" approach continues to influence editorial practice to the present day. Some contemporary scholarship, however, discounts this approach, instead considering \"an authentic Hamlet an unrealisable ideal. ... there are texts of this play but no text\".[41] The 2006 publication by Arden Shakespeare of different Hamlet texts in different volumes is perhaps the best evidence of this shifting focus and emphasis.[42]\n\nTraditionally, editors of Shakespeare\'s plays have divided them into five acts. None of the early texts of Hamlet, however, were arranged this way, and the play\'s division into acts and scenes derives from a 1676 quarto. Modern editors generally follow this traditional division, but consider it unsatisfactory; for example, after Hamlet drags Polonius\'s body out of Gertrude\'s bedchamber, there is an act-break[43] after which the action appears to continue uninterrupted.[44]',0,NULL,NULL,'EarlyeditorsofShakespearesworks','2015-07-15 21:33:20');
INSERT INTO `recDetails` VALUES (192593,30052,3,'The discovery in 1823 of Q1—whose existence had been quite unsuspected—caused considerable interest and excitement, raising many questions of editorial practice and interpretation. Scholars immediately identified apparent deficiencies in Q1, which was instrumental in the development of the concept of a Shakespearean \"bad quarto\".[45] Yet Q1 has value: it contains stage directions that reveal actual stage practices in a way that Q2 and F1 do not; it contains an entire scene (usually labelled 4.6)[46] that does not appear in either Q2 or F1; and it is useful for comparison with the later editions. The scene order is more coherent, without the problems of Q2 and F1 of Hamlet seeming to resolve something in one scene and enter the next drowning in indecision. The major deficiency of Q1 is in the language: particularly noticeable in the opening lines of the famous \"To be, or not to be\" soliloquy: \"To be, or not to be, aye there\'s the point. / To die, to sleep, is that all? Aye all: / No, to sleep, to dream, aye marry there it goes.\"\n\nQ1 is considerably shorter than Q2 or F1 and may be a memorial reconstruction of the play as Shakespeare\'s company performed it, by an actor who played a minor role (most likely Marcellus).[47] Scholars disagree whether the reconstruction was pirated or authorised. Another theory, considered by New Cambridge editor Kathleen Irace, holds that Q1 is an abridged version intended especially for travelling productions.[48] The idea that Q1 is not riddled with error but is instead eminently fit for the stage has led to at least 28 different Q1 productions since 1881.[49]',0,NULL,NULL,'Thediscoveryin1823ofQ1—whoseexi','2015-07-15 21:34:05');
