INSERT INTO `recDetails` VALUES (192642,30289,3,'Cunobeline (or Cunobelin, from Latin Cunobelinus, derived from Greek Kynobellinus, Κυνοβελλίνος) was a king in pre-Roman Britain from the late first century BC until the 40s AD. He is mentioned in passing by the classical historians Suetonius and Dio Cassius, and many coins bearing his inscription have been found. He appears to have controlled a substantial portion of south-eastern Britain, and is called \"King of the Britons\" (Britannorum rex) by Suetonius.\n\nCunobeline appears in British legend as Cynfelyn (Welsh), Kymbelinus (medieval Latin) or Cymbeline, as in the play by William Shakespeare. His name is a compound made up of cuno- (hound) and Belenos (the god Belenus).[1]',0,NULL,NULL,'CunobelineorCunobelinfromLatinC','2015-07-18 19:04:46');
