INSERT INTO `recDetails` VALUES (192713,30309,165,'Marcus Aemilius Lepidus (Latin: M·AEMILIVS·M·F·Q·N·LEPIDVS), (born c. 89 or 88 BC, died late 13 or early 12 BC) was a Roman patrician who was triumvir with Octavian (the future Augustus) and Mark Antony, and the last Pontifex Maximus of the Roman Republic. Lepidus had previously been a close ally of Julius Caesar. Lepidus has always been portrayed as the weakest member of the triumvirate. He was disparaged by a number of ancient historians as feeble and untrustworthy. He typically appears as an easily marginalised figure in depictions of the events of the era, most notably in Shakespeare\'s plays. While some scholars have endorsed this view, others argue that the evidence is insufficient to discount the distorting effects of propaganda by Lepidus\' opponents, principally Cicero, and later, Augustus.',0,NULL,NULL,'MarcusAemiliusLepidusLatinM·AEM','2015-07-18 19:47:41');
