INSERT INTO `recDetails` VALUES (192718,30310,165,'Marcus Vipsanius Agrippa (/əˈɡrɪpə/; 23 October or November 64/63 BC – 12 BC) was a Roman statesman, general and architect. He was a close friend, son-in-law, and lieutenant to Augustus and was responsible for the construction of some of the most beautiful buildings in the history of Rome and for important military victories, most notably at the Battle of Actium against the forces of Mark Antony and Cleopatra. As a result of these victories Octavian became the first Roman Emperor, adopting the name of Augustus. Agrippa assisted Augustus in making Rome a city of marble[3] and renovating aqueducts to give all Romans, from every social class, access to the highest quality public services. He was responsible for the creation of many baths, porticoes and gardens and was once thought to have commissioned the construction of the Pantheon. Agrippa was also father-in-law to the second Emperor Tiberius, maternal grandfather to Caligula, and maternal great-grandfather to the Emperor Nero.',0,NULL,NULL,'MarcusVipsaniusAgrippaəˈɡrɪpə23','2015-07-18 19:47:41');
