INSERT INTO `recDetails` VALUES (192752,30320,165,'Cleopatra VII Philopator (Greek: Κλεοπάτρα Φιλοπάτωρ; 69 – August 12, 30 BC), known to history simply as Cleopatra, was the last active pharaoh of Ptolemaic Egypt, only shortly survived by her son, Caesarion as pharaoh. After her reign, Egypt became a province of the then-recently established Roman Empire. Cleopatra was a member of the Ptolemaic dynasty, a family of Macedonian Greek origin that ruled Egypt after Alexander the Great\'s death during the Hellenistic period. The Ptolemies, throughout their dynasty, spoke Greek[3] and refused to speak Egyptian, which is the reason that Greek as well as Egyptian languages were used on official court documents such as the Rosetta Stone.[4] By contrast, Cleopatra did learn to speak Egyptian[5] and represented herself as the reincarnation of an Egyptian goddess, Isis. Cleopatra originally ruled jointly with her father, Ptolemy XII Auletes, and later with her brothers, Ptolemy XIII and Ptolemy XIV, whom she married as per Egyptian custom, but eventually she became sole ruler. As pharaoh, she consummated a liaison with Julius Caesar that solidified her grip on the throne. She later elevated her son with Caesar, Caesarion, to co-ruler in name. After Caesar\'s assassination in 44 BC, she aligned with Mark Antony in opposition to Caesar\'s legal heir, Gaius Julius Caesar Octavianus (later known as Augustus). With Antony, she bore the twins Cleopatra Selene II and Alexander Helios, and another son, Ptolemy Philadelphus (her unions with her brothers had produced no children). After losing the Battle of Actium to Octavian\'s forces, Antony committed suicide. Cleopatra followed suit, according to tradition killing herself by means of an asp bite on August 12, 30 BC.[6] She was briefly outlived by Caesarion, who was declared pharaoh by his supporters but soon killed on Octavian\'s orders. Egypt became the Roman province of Aegyptus. To this day, Cleopatra remains a popular figure in Western culture. Her legacy survives in numerous works of art and the many dramatizations of her story in literature and other media, including William Shakespeare\'s tragedy Antony and Cleopatra, George Bernard Shaw\'s play Caesar and Cleopatra, Jules Massenet\'s opera Cléopâtre and the 1963 film Cleopatra.',0,NULL,NULL,'CleopatraVIIPhilopatorGreekΚλεο','2015-07-18 19:47:42');
