INSERT INTO `recDetails` VALUES (192814,30337,1,'Cicero',0,NULL,NULL,'Cicero','2015-07-18 20:09:07');
INSERT INTO `recDetails` VALUES (192815,30337,3,'Marcus Tullius Cicero (/ˈsɪsɨroʊ/; Classical Latin: [ˈmaːr.kʊs ˈtʊl.li.ʊs ˈkɪ.kɛ.roː]; Ancient Greek: Κικέρων Kikerōn, sometimes anglicized as Tully /ˈtʌli/; 3 January 106 BC – 7 December 43 BC) was a Roman philosopher, politician, lawyer, orator, political theorist, consul and constitutionalist. He came from a wealthy municipal family of the Roman equestrian order, and is widely considered one of Rome\'s greatest orators and prose stylists.[3] His influence on the Latin language was so immense that the subsequent history of prose in not only Latin but European languages up to the 19th century was said to be either a reaction against or a return to his style.[4] According to Michael Grant, \"the influence of Cicero upon the history of European literature and ideas greatly exceeds that of any other prose writer in any language\".[5] Cicero introduced the Romans to the chief schools of Greek philosophy and created a Latin philosophical vocabulary (with neologisms such as humanitas, qualitas, quantitas, and essentia)[6] distinguishing himself as a linguist, translator, and philosopher. Petrarch\'s rediscovery of Cicero\'s letters is often credited for initiating the 14th-century Renaissance in public affairs, humanism, and classical Roman culture.[7] According to Polish historian Tadeusz Zieliński, \"Renaissance was above all things a revival of Cicero, and only after him and through him of the rest of Classical antiquity.\"[8] The peak of Cicero\'s authority and prestige came during the eighteenth-century Enlightenment,[9] and his impact on leading Enlightenment thinkers such as John Locke, David Hume, and Montesquieu was substantial.[10] His works rank among the most influential in European culture, and today still constitute one of the most important bodies of primary material for the writing and revision of Roman history, especially the last days of the Roman Republic.[11] Though he was an accomplished orator and successful lawyer, Cicero believed his political career was his most important achievement. It was during his consulship that the Second Catilinarian Conspiracy attempted to overthrow the government through an attack on the city by outside forces, and Cicero suppressed the revolt by executing five conspirators without due process. During the chaotic latter half of the 1st century BC marked by civil wars and the dictatorship of Gaius Julius Caesar, Cicero championed a return to the traditional republican government. Following Julius Caesar\'s death Cicero became an enemy of Mark Antony in the ensuing power struggle, attacking him in a series of speeches. He was proscribed as an enemy of the state by the Second Triumvirate and consequently executed by soldiers operating on their behalf in 43 BC after having been intercepted during attempted flight from the Italian peninsula. His severed hands and head were then, as a final revenge of Mark Antony, displayed in the Roman Forum.',0,NULL,NULL,'MarcusTulliusCiceroˈsɪsɨroʊClas','2015-07-18 20:09:07');
