INSERT INTO `recDetails` VALUES (192836,30343,3,'Marcus Antonius (Latin: M·ANTONIVS·M·F·M·N;[note 1] January 14, 83 BC – August 1, 30 BC), commonly known in English as Mark or Marc Antony, was a Roman politician and general who played a critical role in the transformation of the Roman Republic from an oligarchy into the autocratic Roman Empire. Antony was a supporter of Julius Caesar, and served as one of his generals during the conquest of Gaul and the Civil War. Antony was appointed administrator of Italy while Caesar eliminated political opponents in Greece, North Africa, and Spain. After Caesar\'s death in 44 BC, Antony joined forces with Marcus Aemilius Lepidus, another of Caesar\'s generals, and Octavian, Caesar\'s nephew and adopted son, forming a three-man dictatorship known to historians as the Second Triumvirate. The Triumvirs defeated Caesar\'s murderers, the Liberatores, at the Battle of Philippi in 42 BC, and divided the government of the Republic between themselves. Antony was assigned Rome\'s eastern provinces, including the client kingdom of Egypt, then ruled by Cleopatra VII Philopater, and was given the command in Rome\'s war against Parthia. Relations among the Triumvirs were strained as the various members sought greater political power. Civil war between Antony and Octavian was averted in 40 BC, when Antony married Octavian\'s sister, Octavia. Despite this marriage, Antony carried on a love affair with Cleopatra, who bore him three children, further straining Antony\'s relations with Octavian. Lepidus was expelled from the association in 36 BC, and in 33 BC disagreements between Antony and Octavian caused a split between the remaining Triumvirs. Their ongoing hostility erupted into civil war in 31 BC, as the Roman Senate, at Octavian\'s direction, declared war on Cleopatra and proclaimed Antony a traitor. Later that year, Antony was defeated by Octavian\'s forces at the Battle of Actium. Defeated, Antony and Cleopatra fled to Egypt, where they committed suicide. With Antony dead, Octavian was the undisputed master of the Roman world. In 27 BC, he was granted the title of Augustus, marking the final stage in the transformation of the Roman Republic into an empire, with himself as the first Roman emperor.',0,NULL,NULL,'MarcusAntoniusLatinM·ANTONIVS·M','2015-07-18 20:09:08');
