-- GOTCHAS: If one Insert fails that whole table is blank. So you might have no records or no fields.
--          Make sure all users (added by and owned by) for records exist
--          Uploaded files MUST come before recDetails as the latter reference them
--          Bad characters are BINARY in geos(PHPEd will tell you when you try and save) - do not delete (not checked it will import)
--          There is no recLinks or recRelationshipsCache tables in a new database - they are created on the fly

-- For each table:
--     LOCK TABLES `Records` WRITE;
--     SET autocommit=0;
--        <inserts here>
--     UNLOCK TABLES;
--     COMMIT;


LOCK TABLES `Records` WRITE;
SET autocommit=0;
UNLOCK TABLES;
COMMIT;


--
-- Dumping data for table `recUploadedFiles`
--

LOCK TABLES `recUploadedFiles` WRITE;
SET autocommit=0;
UNLOCK TABLES;
COMMIT;




--
-- Dumping data for table `recDetails`
--

LOCK TABLES `recDetails` WRITE;
SET autocommit=0;
UNLOCK TABLES;
COMMIT;

